INSERT INTO `species` VALUES (1,1,'たねポケモン','A strange seed was\nplanted on its\nback at birth. The plant sprouts\nand grows with\nthis POKéMON.','medium-slow',50,45,1),(2,1,'たねポケモン','A strange seed was\nplanted on its\nback at birth. The plant sprouts\nand grows with\nthis POKéMON.','medium-slow',50,45,1),(3,2,'たねポケモン','When the bulb on\nits back grows\nlarge, it appears to lose the\nability to stand\non its hind legs.','medium-slow',50,45,1),(4,3,'たねポケモン','The plant blooms\nwhen it is\nabsorbing solar energy. It stays\non the move to\nseek sunlight.','medium-slow',50,45,1),(5,4,'とかげポケモン','Obviously prefers\nhot places. When\nit rains, steam is said to spout\nfrom the tip of\nits tail.','medium-slow',50,45,1),(6,5,'かえんポケモン','When it swings\nits burning tail,\nit elevates the temperature to\nunbearably high\nlevels.','medium-slow',50,45,1),(7,6,'かえんポケモン','Spits fire that\nis hot enough to\nmelt boulders. Known to cause\nforest fires\nunintentionally.','medium-slow',50,45,1),(8,7,'かめのこポケモン','After birth, its\nback swells and\nhardens into a shell. Powerfully\nsprays foam from\nits mouth.','medium-slow',50,45,1),(9,8,'かめポケモン','Often hides in\nwater to stalk\nunwary prey. For swimming fast, it\nmoves its ears to\nmaintain balance.','medium-slow',50,45,1),(10,9,'こうらポケモン','A brutal POKéMON\nwith pressurized\nwater jets on its shell. They are\nused for high\nspeed tackles.','medium-slow',50,45,1),(11,10,'いもむしポケモン','如果碰到牠頭上的觸角，\n牠就會分泌強烈的臭味\n來保護自己。','medium',50,255,4),(12,11,'さなぎポケモン','This POKéMON is\nvulnerable to\nattack while its shell is soft,\nexposing its weak\nand tender body.','medium',50,120,4),(13,12,'ちょうちょポケモン','In battle, it\nflaps its wings\nat high speed to release highly\ntoxic dust into\nthe air.','medium',50,45,4),(14,13,'けむしポケモン','Often found in\nforests, eating\nleaves. It has a sharp\nvenomous stinger\non its head.','medium',70,255,4),(15,14,'さなぎポケモン','Almost incapable\nof moving, this\nPOKéMON can only harden its shell\nto protect itself\nfrom predators.','medium',70,120,4),(16,15,'どくばちポケモン','It has three poisonous stingers on its forelegs and\nits tail. They are used to jab its enemy repeatedly.','medium',70,45,4),(17,16,'ことりポケモン','A common sight in\nforests and woods.\nIt flaps its wings at ground\nlevel to kick up\nblinding sand.','medium-slow',70,255,4),(18,17,'とりポケモン','Very protective\nof its sprawling\nterritorial area, this POKéMON will\nfiercely peck at\nany intruder.','medium-slow',70,120,4),(19,18,'とりポケモン','When hunting, it\nskims the surface\nof water at high speed to pick off\nunwary prey such\nas MAGIKARP.','medium-slow',70,45,4),(20,19,'ねずみポケモン','キバが２つ。とにかく　なんでも\nかじってみる。１ぴき　みつけたら\n４０ぴきは　そこに　すんでるはず。','medium',70,255,4),(21,20,'ねずみポケモン','Ses pattes arrière lui permettent de traverser les\nrivières. Il est toujours en quête de nourriture.','medium',70,127,4),(22,21,'ことりポケモン','It flaps its small wings busily to\nfly. Using its beak, it searches\nin grass for prey.','medium',70,255,4),(23,22,'くちばしポケモン','With its huge and\nmagnificent wings,\nit can keep aloft without ever\nhaving to land\nfor rest.','medium',70,90,4),(24,23,'へびポケモン','Moves silently\nand stealthily.\nEats the eggs of birds, such as\nPIDGEY and\nSPEAROW, whole.','medium',70,255,4),(25,24,'コブラポケモン','It is rumored that\nthe ferocious\nwarning markings on its belly\ndiffer from area\nto area.','medium',70,90,4),(26,25,'ねずみポケモン','When several of\nthese POKéMON\ngather, their electricity could\nbuild and cause\nlightning storms.','medium',50,190,4),(27,26,'ねずみポケモン','Its long tail serves as a ground to protect itself\nfrom its own high-voltage power.','medium',50,75,4),(28,27,'ねずみポケモン','Burrows deep\nunderground in\narid locations far from water.\nIt only emerges\nto hunt for food.','medium',50,255,4),(29,28,'ねずみポケモン','Curls up into a\nspiny ball when\nthreatened. It can roll while\ncurled up to\nattack or escape.','medium',50,90,4),(30,29,'どくばりポケモン','Although small,\nits venomous\nbarbs render this POKéMON dangerous.\nThe female has\nsmaller horns.','medium-slow',50,235,8),(31,30,'どくばりポケモン','The female\'s horn\ndevelops slowly.\nPrefers physical attacks such as\nclawing and\nbiting.','medium-slow',50,120,8),(32,31,'ドリルポケモン','Its hard scales\nprovide strong\nprotection. It uses its hefty\nbulk to execute\npowerful moves.','medium-slow',50,45,8),(33,32,'どくばりポケモン','Stiffens its ears\nto sense danger.\nThe larger its horns, the more\npowerful its\nsecreted venom.','medium-slow',50,235,0),(34,33,'どくばりポケモン','神經質且容易發脾氣打架。\n當體內的腎上腺素增加時，\n毒素的濃度也會提升。','medium-slow',50,120,0),(35,34,'ドリルポケモン','It uses its\npowerful tail in\nbattle to smash, constrict, then\nbreak the prey\'s\nbones.','medium-slow',50,45,0),(36,35,'ようせいポケモン','Its magical and\ncute appeal has\nmany admirers. It is rare and\nfound only in\ncertain areas.','fast',140,150,6),(37,36,'ようせいポケモン','A timid fairy\nPOKéMON that is\nrarely seen. It will run and hide\nthe moment it\nsenses people.','fast',140,25,6),(38,37,'きつねポケモン','At the time of\nbirth, it has\njust one tail. The tail splits\nfrom its tip as\nit grows older.','medium',50,190,6),(39,38,'きつねポケモン','Very smart and\nvery vengeful.\nGrabbing one of its many tails\ncould result in a\n1000-year curse.','medium',50,75,6),(40,39,'ふうせんポケモン','When its huge eyes\nlight up, it sings\na mysteriously soothing melody\nthat lulls its\nenemies to sleep.','fast',50,170,6),(41,40,'ふうせんポケモン','The body is soft\nand rubbery. When\nangered, it will suck in air and\ninflate itself to\nan enormous size.','fast',50,50,6),(42,41,'こうもりポケモン','因為沒有眼珠所以看不見東西。\n會從口中發出超音波\n來探測周圍的狀況。','medium',50,255,4),(43,42,'こうもりポケモン','Once it strikes,\nit will not stop\ndraining energy from the victim\neven if it gets\ntoo heavy to fly.','medium',50,90,4),(44,43,'ざっそうポケモン','During the day,\nit keeps its face\nburied in the ground. At night,\nit wanders around\nsowing its seeds.','medium-slow',50,255,4),(45,44,'ざっそうポケモン','The fluid that\noozes from its\nmouth isn\'t drool. It is a nectar\nthat is used to\nattract prey.','medium-slow',50,120,4),(46,45,'フラワーポケモン','It has the world’s largest petals. With every step,\nthe petals shake out heavy clouds of toxic pollen.','medium-slow',50,45,4),(47,46,'きのこポケモン','Burrows to suck\ntree roots. The\nmushrooms on its back grow by draw­\ning nutrients from\nthe bug host.','medium',70,190,4),(48,47,'きのこポケモン','A host-parasite\npair in which the\nparasite mushroom has taken over the\nhost bug. Prefers\ndamp places.','medium',70,75,4),(49,48,'こんちゅうポケモン','Lives in the\nshadows of tall\ntrees where it eats insects. It\nis attracted by\nlight at night.','medium',70,190,4),(50,49,'どくがポケモン','The dustlike scales covering its wings\nare color-coded to indicate the kinds of\npoison it has.','medium',70,75,4),(51,50,'もぐらポケモン','피부가 매우 얇아서\n빛을 쪼이게 되면 혈액이\n데워져 약해진다.','medium',50,255,4),(52,51,'もぐらポケモン','A team of DIGLETT\ntriplets.\nIt triggers huge earthquakes by\nburrowing 60 miles\nunderground.','medium',50,50,4),(53,52,'ばけねこポケモン','It washes its face regularly to keep the coin on\nits forehead spotless. It doesn’t get along with\nGalarian Meowth.','medium',50,255,4),(54,53,'シャムネコポケモン','Although its fur\nhas many admirers,\nit is tough to raise as a pet\nbecause of its\nfickle meanness.','medium',50,90,4),(55,54,'あひるポケモン','While lulling its\nenemies with its\nvacant look, this wily POKéMON will\nuse psychokinetic\npowers.','medium',50,190,4),(56,55,'あひるポケモン','Often seen swim­\nming elegantly by\nlake shores. It is often mistaken\nfor the Japanese\nmonster, Kappa.','medium',50,75,4),(57,56,'ぶたざるポケモン','Extremely quick to\nanger. It could\nbe docile one moment then\nthrashing away\nthe next instant.','medium',70,190,4),(58,57,'ぶたざるポケモン','Always furious\nand tenacious to\nboot. It will not abandon chasing\nits quarry until\nit is caught.','medium',70,75,4),(59,58,'こいぬポケモン','Very protective\nof its territory.\nIt will bark and bite to repel\nintruders from\nits space.','slow',50,190,2),(60,59,'でんせつポケモン','A POKéMON that\nhas been admired\nsince the past for its beauty.\nIt runs agilely\nas if on wings.','slow',50,75,2),(61,60,'おたまポケモン','Its newly grown\nlegs prevent it\nfrom running. It appears to prefer\nswimming than\ntrying to stand.','medium-slow',50,255,4),(62,61,'おたまポケモン','Capable of living\nin or out of\nwater. When out of water, it\nsweats to keep\nits body slimy.','medium-slow',50,120,4),(63,62,'おたまポケモン','An adept swimmer\nat both the front\ncrawl and breast stroke. Easily\novertakes the best\nhuman swimmers.','medium-slow',50,45,4),(64,63,'ねんりきポケモン','Using its ability\nto read minds, it\nwill identify impending danger\nand TELEPORT to\nsafety.','medium-slow',50,200,2),(65,64,'ねんりきポケモン','It emits special\nalpha waves from\nits body that induce headaches\njust by being\nclose by.','medium-slow',50,100,2),(66,65,'ねんりきポケモン','Its brain can out­\nperform a super­\ncomputer. Its intelligence\nquotient is said\nto be 5,000.','medium-slow',50,50,2),(67,66,'かいりきポケモン','Malgré sa petite taille, sa force\nlui permet de soulever plusieurs\nRacaillou à la fois.','medium-slow',50,180,2),(68,67,'かいりきポケモン','Its muscular body\nis so powerful, it\nmust wear a power save belt to be\nable to regulate\nits motions.','medium-slow',50,90,2),(69,68,'かいりきポケモン','Using its heavy\nmuscles, it throws\npowerful punches that can send the\nvictim clear over\nthe horizon.','medium-slow',50,45,2),(70,69,'フラワーポケモン','A carnivorous\nPOKéMON that traps\nand eats bugs. It uses its root\nfeet to soak up\nneeded moisture.','medium-slow',70,255,4),(71,70,'ハエとりポケモン','It spits out\nPOISONPOWDER to\nimmobilize the enemy and then\nfinishes it with\na spray of ACID.','medium-slow',70,120,4),(72,71,'ハエとりポケモン','Dieses Pokémon soll in großen Kolonien\ntief im Dschungel leben, doch niemand\nkann dies bestätigen.','medium-slow',70,45,4),(73,72,'くらげポケモン','Drifts in shallow\nseas. Anglers who\nhook them by accident are\noften punished by\nits stinging acid.','slow',50,190,4),(74,73,'くらげポケモン','The tentacles are\nnormally kept\nshort. On hunts, they are extended\nto ensnare and\nimmobilize prey.','slow',50,60,4),(75,74,'がんせきポケモン','Found in fields\nand mountains.\nMistaking them for boulders,\npeople often step\nor trip on them.','medium-slow',70,255,4),(76,75,'がんせきポケモン','De naturaleza descuidada y libre, no le importa\ndañarse cuando baja rodando montañas.','medium-slow',70,120,4),(77,76,'メガトンポケモン','Its boulder-like\nbody is extremely\nhard. It can easily withstand\ndynamite blasts\nwithout damage.','medium-slow',70,45,4),(78,77,'ひのうまポケモン','Its hooves are 10\ntimes harder than\ndiamonds. It can trample anything\ncompletely flat\nin little time.','medium',50,190,4),(79,78,'ひのうまポケモン','Galopa a casi 240 km por hora. Su crin ardiente\nparece una flecha cuando corre.','medium',50,60,4),(80,79,'まぬけポケモン','Descansa ocioso junto al agua. Si algo muerde su\ncola, no lo notará en todo el día.','medium',50,190,4),(81,80,'やどかりポケモン','The SHELLDER that\nis latched onto\nSLOWPOKE\'s tail is said to feed\non the host\'s left\nover scraps.','medium',50,75,4),(82,81,'じしゃくポケモン','Uses anti-gravity\nto stay suspended.\nAppears without warning and uses\nTHUNDER WAVE and\nsimilar moves.','medium',50,190,-1),(83,82,'じしゃくポケモン','Formed by several\nMAGNEMITEs linked\ntogether. They frequently appear\nwhen sunspots\nflare up.','medium',50,60,-1),(84,83,'かるがもポケモン','The sprig of\ngreen onions it\nholds is its weapon. It is\nused much like a\nmetal sword.','medium',50,45,4),(85,84,'ふたごどりポケモン','A bird that makes\nup for its poor\nflying with its fast foot speed.\nLeaves giant\nfootprints.','medium',70,190,4),(86,85,'みつごどりポケモン','由嘟嘟的某个头分裂\n出的变种。以60千米的\n时速在草原上奔跑。','medium',70,45,4),(87,86,'あしかポケモン','The protruding\nhorn on its head\nis very hard. It is used for\nbashing through\nthick ice.','medium',70,190,4),(88,87,'あしかポケモン','Stores thermal\nenergy in its\nbody. Swims at a steady 8 knots\neven in intensely\ncold waters.','medium',70,75,4),(89,88,'ヘドロポケモン','Appears in filthy\nareas. Thrives by\nsucking up polluted sludge\nthat is pumped\nout of factories.','medium',70,190,4),(90,89,'ヘドロポケモン','Thickly covered\nwith a filthy,\nvile sludge. It is so toxic, even\nits footprints\ncontain poison.','medium',70,75,4),(91,90,'２まいがいポケモン','Its hard shell\nrepels any kind\nof attack. It is vulnerable\nonly when its\nshell is open.','slow',50,190,4),(92,91,'２まいがいポケモン','When attacked, it\nlaunches its\nhorns in quick volleys. Its\ninnards have\nnever been seen.','slow',50,60,4),(93,92,'ガスじょうポケモン','Almost invisible,\nthis gaseous\nPOKéMON cloaks the target and\nputs it to sleep\nwithout notice.','medium-slow',50,190,4),(94,93,'ガスじょうポケモン','Because of its\nability to slip\nthrough block walls, it is said\nto be from an­\nother dimension.','medium-slow',50,90,4),(95,94,'シャドーポケモン','Under a full moon,\nthis POKéMON\nlikes to mimic the shadows of\npeople and laugh\nat their fright.','medium-slow',50,45,4),(96,95,'いわへびポケモン','As it grows, the\nstone portions of\nits body harden to become similar\nto a diamond, but\ncolored black.','medium',50,45,4),(97,96,'さいみんポケモン','Puts enemies to\nsleep then eats\ntheir dreams. Occasionally gets\nsick from eating\nbad dreams.','medium',70,190,4),(98,97,'さいみんポケモン','When it locks eyes\nwith an enemy, it\nwill use a mix of PSI moves such as\nHYPNOSIS and\nCONFUSION.','medium',70,75,4),(99,98,'さわがにポケモン','Its pincers are\nnot only powerful\nweapons, they are used for balance\nwhen walking\nsideways.','medium',50,225,4),(100,99,'はさみポケモン','The large pincer\nhas 10000 hp of\ncrushing power. However, its huge\nsize makes it\nunwieldy to use.','medium',50,60,4),(101,100,'ボールポケモン','Usually found in\npower plants.\nEasily mistaken for a POKé BALL,\nthey have zapped\nmany people.','medium',70,190,-1),(102,101,'ボールポケモン','It stores electric\nenergy under very\nhigh pressure. It often explodes\nwith little or no\nprovocation.','medium',70,60,-1),(103,102,'たまごポケモン','Often mistaken\nfor eggs.\nWhen disturbed, they quickly\ngather and attack\nin swarms.','slow',50,90,4),(104,103,'やしのみポケモン','Legend has it that\non rare occasions,\none of its heads will drop off and\ncontinue on as an\nEXEGGCUTE.','slow',50,45,4),(105,104,'こどくポケモン','Because it never\nremoves its skull\nhelmet, no one has ever seen\nthis POKéMON\'s\nreal face.','medium',50,190,4),(106,105,'ほねずきポケモン','将骨头像回力镖一样扔出去，\n击落天敌秃鹰娜来复仇。','medium',50,75,4),(107,106,'キックポケモン','When in a hurry,\nits legs lengthen\nprogressively. It runs smoothly\nwith extra long,\nloping strides.','medium',50,45,0),(108,107,'パンチポケモン','While apparently\ndoing nothing, it\nfires punches in lightning fast\nvolleys that are\nimpossible to see.','medium',50,45,0),(109,108,'なめまわしポケモン','Its tongue can be\nextended like a\nchameleon\'s. It leaves a tingling\nsensation when it\nlicks enemies.','medium',50,45,4),(110,109,'どくガスポケモン','Because it stores\nseveral kinds of\ntoxic gases in its body, it is\nprone to exploding\nwithout warning.','medium',50,190,4),(111,110,'どくガスポケモン','Where two kinds\nof poison gases\nmeet, 2 KOFFINGs can fuse into a\nWEEZING over many\nyears.','medium',50,60,4),(112,111,'とげとげポケモン','A POKéMON with a\none-track mind.\nOnce it charges,  it won\'t stop\nrunning until it\nfalls asleep.','slow',50,120,4),(113,112,'ドリルポケモン','Protected by an\narmor-like hide,\nit is capable of living in molten\nlava of 3,600\ndegrees.','slow',50,60,4),(114,113,'たまごポケモン','A rare and elusive\nPOKéMON that is\nsaid to bring happiness to those\nwho manage to get\nit.','fast',140,30,8),(115,114,'ツルじょうポケモン','The whole body is\nswathed with wide\nvines that are similar to sea­\nweed. Its vines\nshake as it walks.','medium',50,45,4),(116,115,'おやこポケモン','The infant rarely\nventures out of\nits mother\'s protective pouch\nuntil it is 3\nyears old.','medium',50,45,8),(117,116,'ドラゴンポケモン','Known to shoot\ndown flying bugs\nwith precision blasts of ink\nfrom the surface\nof the water.','medium',50,225,4),(118,117,'ドラゴンポケモン','Capable of swim­\nming backwards by\nrapidly flapping its wing-like\npectoral fins and\nstout tail.','medium',50,75,4),(119,118,'きんぎょポケモン','Its tail fin\nbillows like an\nelegant ball