\nenables it to live on land. This POKéMON plays in mud on beaches\nwhen the ocean tide is low.','medium-slow',50,45,1),(261,260,'ぬまうおポケモン','SWAMPERT is very strong. It has enough\npower to easily drag a boulder weighing\nmore than a ton. This POKéMON also has powerful vision\nthat lets it see even in murky water.','medium-slow',50,45,1),(262,261,'かみつきポケモン','At first sight, POOCHYENA takes a bite\nat anything that moves.\nThis POKéMON chases after prey until the victim becomes exhausted.\nHowever, it may turn tail if the prey\nstrikes back.','medium',70,255,4),(263,262,'かみつきポケモン','Les Grahyèna forment des meutes de dix qui\nexcellent au travail de groupe pour capturer leurs\nproies.','medium',70,127,4),(264,263,'まめだぬきポケモン','ZIGZAGOON restlessly wanders\neverywhere at all times. This POKéMON\ndoes so because it is very curious. It becomes interested in anything\nthat it happens to see.','medium',50,255,4),(265,264,'とっしんポケモン','LINOONE always runs full speed and only\nin straight lines. If facing an obstacle,\nit makes a right-angle turn to evade it. This POKéMON is very challenged by\ngently curving roads.','medium',50,90,4),(266,265,'いもむしポケモン','Le encanta comer hojas. Si le ataca un Starly, se\ndefenderá con sus púas.','medium',70,255,4),(267,266,'さなぎポケモン','SILCOON tethers itself to a tree branch\nusing silk to keep from falling. There, \nthis POKéMON hangs quietly while it awaits evolution.\nIt peers out of the silk cocoon through\na small hole.','medium',70,120,4),(268,267,'ちょうちょポケモン','BEAUTIFLY’s favorite food is the sweet\npollen of flowers. If you want to see\nthis POKéMON, just leave a potted flower by an open window. BEAUTIFLY\nis sure to come looking for pollen.','medium',70,45,4),(269,268,'さなぎポケモン','CASCOON makes its protective cocoon\nby wrapping its body entirely with a\nfine silk from its mouth. Once the silk goes around its body, it hardens.\nThis POKéMON prepares for its evolution\ninside the cocoon.','medium',70,120,4),(270,269,'どくがポケモン','DUSTOX is instinctively drawn to light.\nSwarms of this POKéMON are attracted\nby the bright lights of cities, where they wreak havoc by stripping the\nleaves off roadside trees for food.','medium',70,45,4),(271,270,'うきくさポケモン','It searches about for clean water. If it does not\ndrink water for too long, the leaf on its head wilts.','medium-slow',50,255,4),(272,271,'ようきポケモン','It lives at the water’s edge where it is\nsunny. It sleeps on a bed of water grass\nby day and becomes active at night.','medium-slow',50,120,4),(273,272,'のうてんきポケモン','LUDICOLO begins dancing as soon as\nit hears cheerful, festive music.\nThis POKéMON is said to appear when it hears the singing of children on hiking\noutings.','medium-slow',50,45,4),(274,273,'どんぐりポケモン','SEEDOT attaches itself to a tree\nbranch using the top of its head.\nIt sucks moisture from the tree while hanging off the branch.\nThe more water it drinks, the glossier\nthis POKéMON’s body becomes.','medium-slow',50,255,4),(275,274,'いじわるポケモン','NUZLEAF live in densely overgrown\nforests. They occasionally venture out\nof the forest to startle people. This POKéMON dislikes having its long\nnose pinched.','medium-slow',50,120,4),(276,275,'よこしまポケモン','It lives quietly in the deep forest.\nIt is said to create chilly winter\nwinds with the fans it holds.','medium-slow',50,45,4),(277,276,'こツバメポケモン','TAILLOW courageously stands its\nground against foes, however strong\nthey may be. This gutsy POKéMON will remain defiant\neven after a loss. On the other hand,\nit cries loudly if it becomes hungry.','medium-slow',70,200,4),(278,277,'ツバメポケモン','SWELLOW flies high above our heads,\nmaking graceful arcs in the sky.\nThis POKéMON dives at a steep angle as soon as it spots its prey. The hapless\nprey is tightly grasped by SWELLOW’s\nclawed feet, preventing escape.','medium-slow',70,45,4),(279,278,'うみねこポケモン','WINGULL has the habit of carrying prey\nand valuables in its beak and hiding\nthem in all sorts of locations. This POKéMON rides the winds and flies\nas if it were skating across the sky.','medium',50,190,4),(280,279,'みずどりポケモン','It is a messenger of the skies,\ncarrying small Pokémon and\neggs to safety in its bill.','medium',50,45,4),(281,280,'きもちポケモン','RALTS senses the emotions of\npeople using the horns on its head.\nThis POKéMON rarely appears before people. But when it does, it draws\ncloser if it senses that the person has\na positive disposition.','slow',35,235,4),(282,281,'かんじょうポケモン','It is said that a KIRLIA that is\nexposed to the positive emotions of\nits TRAINER grows beautiful. This POKéMON controls psychokinetic\npowers with its highly developed brain.','slow',35,120,4),(283,282,'ほうようポケモン','GARDEVOIR has the ability to read the\nfuture. If it senses impending danger\nto its TRAINER, this POKéMON is said to unleash its psychokinetic energy at\nfull power.','slow',35,45,4),(284,283,'あめんぼポケモン','すいめんを　すべるように　あるく。\nあたまの　さきから　あまい　においを\nだして　えものを　さそう。','medium',70,200,4),(285,284,'めだまポケモン','MASQUERAIN intimidates enemies with\nthe eyelike patterns on its antennas.\nThis POKéMON flaps its four wings to freely fly in any direction - even\nsideways and backwards - as if it were\na helicopter.','medium',70,75,4),(286,285,'きのこポケモン','SHROOMISH live in damp soil in the dark\ndepths of forests. They are often\nfound keeping still under fallen leaves. This POKéMON feeds on compost that\nis made up of fallen, rotted leaves.','fast-then-very-slow',70,255,4),(287,286,'きのこポケモン','Erst lässt es den Gegner seine giftigen Sporen\neinatmen, dann traktiert es ihn mit Boxschlägen.','fast-then-very-slow',70,90,4),(288,287,'なまけものポケモン','SLAKOTH lolls around for over twenty\nhours every day. Because it moves so\nlittle, it does not need much food. This POKéMON’s sole daily meal consists\nof just three leaves.','slow',70,255,4),(289,288,'あばれザルポケモン','VIGOROTH is always itching and agitated\nto go on a wild rampage. It simply can’t\ntolerate sitting still for even a minute. This POKéMON’s stress level rises if it\ncan’t be moving constantly.','slow',70,120,4),(290,289,'ものぐさポケモン','SLAKING spends all day lying down and\nlolling about.\nIt eats grass growing within its reach. If it eats all the grass it can reach,\nthis POKéMON reluctantly moves to\nanother spot.','slow',70,45,4),(291,290,'したづみポケモン','NINCADA lives underground for many\nyears in complete darkness.\nThis POKéMON absorbs nutrients from the roots of trees. It stays motionless\nas it waits for evolution.','slow-then-very-fast',50,255,4),(292,291,'しのびポケモン','NINJASK moves around at such a high\nspeed that it cannot be seen, even\nwhile its crying can be clearly heard. For that reason, this POKéMON was long\nbelieved to be invisible.','slow-then-very-fast',50,120,4),(293,292,'ぬけがらポケモン','SHEDINJA’s hard body doesn’t move -\nnot even a twitch. In fact, its body\nappears to be merely a hollow shell. It is believed that this POKéMON will\nsteal the spirit of anyone peering into\nits hollow body from its back.','slow-then-very-fast',50,45,-1),(294,293,'ささやきポケモン','Normally, WHISMUR’s voice is very quiet -\nit is barely audible even if one is\npaying close attention. However, if this POKéMON senses danger,\nit starts crying at an earsplitting\nvolume.','medium-slow',50,190,4),(295,294,'おおごえポケモン','LOUDRED’s bellowing can completely\ndecimate a wood-frame house. It uses\nits voice to punish its foes. This POKéMON’s round ears serve as\nloudspeakers.','medium-slow',50,120,4),(296,295,'そうおんポケモン','EXPLOUD triggers earthquakes with the\ntremors it creates by bellowing. If this\nPOKéMON violently inhales from the ports on its body, it’s a sign that it is\npreparing to let loose a huge bellow.','medium-slow',50,45,4),(297,296,'こんじょうポケモン','MAKUHITA is tenacious - it will keep\ngetting up and attacking its foe\nhowever many times it is knocked down. Every time it gets back up, this\nPOKéMON stores more energy in its body\nfor evolving.','fast-then-very-slow',70,180,2),(298,297,'つっぱりポケモン','It has the habit of challenging others\nwithout hesitation to tests of strength.\nIt’s been known to stand on train tracks\nand stop trains using forearm thrusts.','fast-then-very-slow',70,200,2),(299,298,'みずたまポケモン','A Pokémon that lives by water.\nIt moves quickly on land by\nbouncing on its big tail.','fast',50,150,6),(300,299,'コンパスポケモン','NOSEPASS’s magnetic nose is always\npointed to the north. If two of these\nPOKéMON meet, they cannot turn their faces to each other when they\nare close because their magnetic noses\nrepel one another.','medium',70,255,4),(301,300,'こねこポケモン','SKITTY has the habit of becoming\nfascinated by moving objects and\nchasing them around. This POKéMON is known to chase after\nits own tail and become dizzy.','fast',70,255,6),(302,301,'おすましポケモン','DELCATTY prefers to live an unfettered\nexistence in which it can do as it\npleases at its own pace. Because this POKéMON eats and sleeps\nwhenever it decides, its daily routines\nare completely random.','fast',70,60,6),(303,302,'くらやみポケモン','SABLEYE lead quiet lives deep inside\ncaverns. They are feared, however,\nbecause these POKéMON are thought to steal the spirits of people when their\neyes burn with a sinister glow in the\ndarkness.','medium-slow',35,45,4),(304,303,'あざむきポケモン','MAWHILE’s huge jaws are actually steel\nhorns that have been transformed.\nIts docile-looking face serves to lull its foe into letting down its guard.\nWhen the foe least expects it, MAWHILE\nchomps it with its gaping jaws.','fast',50,45,4),(305,304,'てつヨロイポケモン','This POKéMON has a body of steel.\nTo make its body, ARON feeds on\niron ore that it digs from mountains. Occasionally, it causes major trouble by\neating bridges and rails.','slow',35,180,4),(306,305,'てつヨロイポケモン','LAIRON tempers its steel body by\ndrinking highly nutritious mineral\nspringwater until it is bloated. This POKéMON makes its nest close to\nsprings of delicious water.','slow',35,90,4),(307,306,'てつヨロイポケモン','AGGRON claims an entire mountain as its\nown territory. It mercilessly beats up\nanything that violates its environment. This POKéMON vigilantly patrols its\nterritory at all times.','slow',35,45,4),(308,307,'めいそうポケモン','１にち　１こだけ　きのみを　たべる。\nくうふくに　たえることで\nこころが　とぎすまされていく。','medium',70,180,4),(309,308,'めいそうポケモン','It is said that through meditation,\nMEDICHAM heightens energy inside\nits body and sharpens its sixth sense. This POKéMON hides its presence by\nmerging itself with fields and\nmountains.','medium',70,90,4),(310,309,'いなずまポケモン','ELECTRIKE stores electricity in its\nlong body hair. This POKéMON stimulates\nits leg muscles with electric charges. These jolts of power give its legs\nexplosive acceleration performance.','slow',50,120,4),(311,310,'ほうでんポケモン','MANECTRIC is constantly discharging\nelectricity from its mane. The sparks\nsometimes ignite forest fires. When it enters a battle, this POKéMON\ncreates thunderclouds.','slow',50,45,4),(312,311,'おうえんポケモン','PLUSLE always acts as a cheerleader\nfor its partners. Whenever a teammate\nputs out a good effort in battle, this POKéMON shorts out its body to create\nthe crackling noises of sparks to show\nits joy.','medium',70,200,4),(313,312,'おうえんポケモン','MINUN is more concerned about cheering\non its partners than its own safety.\nIt shorts out the electricity in its body to create brilliant showers of\nsparks to cheer on its teammates.','medium',70,200,4),(314,313,'ほたるポケモン','With the arrival of night, VOLBEAT emits\nlight from its tail. It communicates with\nothers by adjusting the intensity and flashing of its light.\nThis POKéMON is attracted by the sweet\naroma of ILLUMISE.','slow-then-very-fast',70,150,0),(315,314,'ほたるポケモン','With its sweet aroma, it guides\nVolbeat to draw signs with light in\nthe night sky.','fast-then-very-slow',70,150,8),(316,315,'いばらポケモン','ROSELIA shoots sharp thorns as\nprojectiles at any opponent that tries\nto steal the flowers on its arms. The aroma of this POKéMON brings\nserenity to living things.','medium-slow',50,150,4),(317,316,'いぶくろポケモン','Virtually all of GULPIN’s body is its\nstomach. As a result, it can swallow\nsomething its own size. This POKéMON’s stomach contains a\nspecial fluid that digests anything.','fast-then-very-slow',70,225,4),(318,317,'どくぶくろポケモン','Es verschluckt, was in sein Maul passt, und verdaut es\nmit seiner alles zersetzenden Magensäure.','fast-then-very-slow',70,75,4),(319,318,'どうもうポケモン','CARVANHA’s strongly developed jaws\nand its sharply pointed fangs pack the\ndestructive power to rip out boat hulls. Many boats have been attacked and\nsunk by this POKéMON.','slow',35,225,4),(320,319,'きょうぼうポケモン','Nicknamed “the bully of the sea,”\nSHARPEDO is widely feared.\nIts cruel fangs grow back immediately if they snap off.\nJust one of these POKéMON can\nthoroughly tear apart a supertanker.','slow',35,60,4),(321,320,'たまくじらポケモン','WAILMER’s nostrils are located above\nits eyes. This playful POKéMON loves\nto startle people by forcefully snorting out seawater it stores inside its body\nout of its nostrils.','fast-then-very-slow',50,125,4),(322,321,'うきくじらポケモン','WAILORD is the largest of all identified\nPOKéMON up to now.\nThis giant POKéMON swims languorously in the vast open sea, eating massive\namounts of food at once with its\nenormous mouth.','fast-then-very-slow',50,60,4),(323,322,'どんかんポケモン','NUMEL is extremely dull witted - it\ndoesn’t notice being hit. However, it\ncan’t stand hunger for even a second. This POKéMON’s body is a seething\ncauldron of boiling magma.','medium',70,255,4),(324,323,'ふんかポケモン','CAMERUPT has a volcano inside its body.\nMagma of 18,000 degrees F courses\nthrough its body. Occasionally, the humps on this\nPOKéMON’s back erupt, spewing the\nsuperheated magma.','medium',70,150,4),(325,324,'せきたんポケモン','You can tell how it’s feeling by the smoke\nspouting from its shell. Tremendous velocity\nis a sign of good health.','medium',50,90,4),(326,325,'とびはねポケモン','SPOINK bounces around on its tail.\nThe shock of its bouncing makes its\nheart pump. As a result, this POKéMON cannot afford to stop bouncing - if it\nstops, its heart will stop.','fast',70,255,4),(327,326,'あやつりポケモン','GRUMPIG uses the black pearls on its\nbody to amplify its psychic power waves\nfor gaining total control over its foe. When this POKéMON uses its special\npower, its snorting breath grows\nlabored.','fast',70,60,4),(328,327,'ぶちパンダポケモン','No two Spinda have the same\npattern of spots. Its tottering\nstep fouls the aim of foes.','fast',70,255,4),(329,328,'ありじごくポケモン','TRAPINCH’s nest is a sloped, bowl-like\npit dug in sand. This POKéMON patiently\nwaits for prey to tumble down the pit. Its giant jaws have enough strength\nto crush even boulders.','medium-slow',50,255,4),(330,329,'しんどうポケモン','２片翅膀高速振動\n產生的超音波會\n引起劇烈的頭痛。','medium-slow',50,120,4),(331,330,'せいれいポケモン','FLYGON is nicknamed “the elemental \nspirit of the desert.” Because its\nflapping wings whip up a cloud of sand, this POKéMON is always enveloped in a\nsandstorm while flying.','medium-slow',50,45,4),(332,331,'サボテンポケモン','En stockant l’eau dans son corps,\ncet habitant du désert peut \nsurvivre 30 jours sans boire.','medium-slow',35,190,4),(333,332,'カカシぐさポケモン','During the daytime, CACTURNE remains\nunmoving so that it does not lose any\nmoisture to the harsh desert sun. This POKéMON becomes active at night\nwhen the temperature drops.','medium-slow',35,60,4),(334,333,'わたどりポケモン','SWABLU has light and fluffy wings that\nare like cottony clouds. This POKéMON\nis not frightened of people. It lands on the heads of people and\nsits there like a cotton-fluff hat.','slow-then-very-fast',50,255,4),(335,334,'ハミングポケモン','Il vole librement en se cachant dans les nuages.\nSon chant est digne de celui de la plus douée des\nsopranos.','slow-then-very-fast',50,45,4),(336,335,'ネコイタチポケモン','Memories of battling its arch-rival\nSEVIPER are etched into every cell of\nZANGOOSE’s body. This POKéMON adroitly dodges attacks\nwith incredible agility.','slow-then-very-fast',70,90,4),(337,336,'キバへびポケモン','SEVIPER shares a generations-long\nfeud with ZANGOOSE. The scars on its\nbody are evidence 