4),(571,570,'わるぎつねポケモン','Il a le pouvoir de prendre l’apparence\ndes autres. On dit qu’il se transforme\nsouvent en petit enfant silencieux.','medium-slow',50,75,1),(572,571,'ばけぎつねポケモン','Ces Pokémon protègent les leurs en\nprenant l’apparence de leurs ennemis.\nIls forment des groupes très soudés.','medium-slow',50,45,1),(573,572,'チンチラポケモン','Ils se saluent en se caressant\nmutuellement le corps avec la queue,\nqu’ils gardent toujours immaculée.','fast',50,255,6),(574,573,'スカーフポケモン','Leurs poils blancs sont recouverts\nd’une graisse spéciale qui leur permet\nd’esquiver facilement les attaques.','fast',50,60,6),(575,574,'ぎょうしポケモン','Concentre des pouvoirs psychiques dans\nses antennes semblables à des rubans,\net regarde fixement... mais quoi?','medium-slow',50,200,6),(576,575,'あやつりポケモン','Hypnotise les Pokémon et les gens. Il y a\nde nombreuses légendes de gens enlevés\ndans leur sommeil par des Mesmérella.','medium-slow',50,100,6),(577,576,'てんたいポケモン','Ses pouvoirs psychiques plient l’espace\naux alentours. On y voit des étoiles\néloignées de millions d’années-lumière.','medium-slow',50,50,6),(578,577,'さいぼうポケモン','Ils repoussent leurs assaillants\navec leurs pouvoirs psychiques et\ncommuniquent entre eux par télépathie.','medium-slow',50,200,4),(579,578,'ぶんかつポケモン','Cuando las dos partes de su cerebro piensan lo\nmismo, saca todo su poder a relucir.','medium-slow',50,100,4),(580,579,'ぞうふくポケモン','Quand ils se tiennent par la main,\nleurs cerveaux forment un réseau qui\ndémultiplie leurs pouvoirs psychiques.','medium-slow',50,50,4),(581,580,'みずどりポケモン','Un Pokémon Oiseau doué pour la plongée.\nIl nage sous l’eau à la recherche de\nsphaigne, son plat préféré.','medium',70,190,4),(582,581,'しらとりポケモン','Ils se mettent à danser à la tombée\nde la nuit. Le Lakmécygne qui danse\nau centre est le chef de la troupe.','medium',70,45,4),(583,582,'しんせつポケモン','Il exhale une haleine à -50 °C.\nIl fabrique des cristaux de neige\net fait neiger autour de lui.','slow',50,255,4),(584,583,'ひょうせつポケモン','Un Pokémon qui vit dans les montagnes\nenneigées. Il a émigré au sud durant\nl’ère glaciaire, il y a bien longtemps.','slow',50,120,4),(585,584,'ブリザードポケモン','Il avale de l’eau en grande quantité\net la transforme en nuages neigeux.\nIl souffle du blizzard sur ses ennemis.','slow',50,45,4),(586,585,'きせつポケモン','Son pelage prend la même couleur et la\nmême odeur que les hautes herbes. S’il\nsent un ennemi, il court s’y réfugier.','medium',70,190,4),(587,586,'きせつポケモン','Il change d’habitat selon les saisons.\nLes gens constatent le passage des\nsaisons en regardant ses ramures.','medium',70,75,4),(588,587,'モモンガポケモン','Il accumule dans ses membranes\nl’électricité qu’il produit dans ses\nbajoues, et la relâche tout en planant.','medium',50,200,4),(589,588,'かぶりつきポケモン','Un Pokémon mystérieux qui évolue quand\nil reçoit un stimulus électrique en étant\nproche d’un Escargaume.','medium',50,200,4),(590,589,'きへいポケモン','Ce Pokémon se protège avec la carapace dérobée à un\nEscargaume et attaque avec ses deux redoutables lances.','medium',50,75,4),(591,590,'きのこポケモン','Grâce à sa ressemblance mystérieuse\navec une Poké Ball, il attire ses ennemis\net relâche des spores empoisonnées.','medium',50,190,4),(592,591,'きのこポケモン','Il danse en faisant tournoyer les\ncoupoles en forme de Poké Ball de\nses bras pour attirer ses proies.','medium',50,75,4),(593,592,'ふゆうポケモン','Il s’enfonce dans les profondeurs de la\nmer en emmenant son ennemi, qu’il ligote\navec ses bras fins comme des voiles.','medium',50,190,4),(594,593,'ふゆうポケモン','Les bateaux qui s’aventurent sur\nson territoire coulent, et Moyade\naspire l’énergie vitale des marins.','medium',50,60,4),(595,594,'かいほうポケモン','La membrane spéciale qui entoure\nson corps a la capacité de guérir\nles blessures.','fast',70,75,4),(596,595,'くっつきポケモン','Les Statitik qui vivent en ville ont\nappris à aspirer le courant depuis\nles prises électriques des maisons.','medium',50,190,4),(597,596,'でんきグモポケモン','Quand on l’attaque, il projette une\nmultitude de 