\nSi une lame s’émousse, il va l’aiguiser\ncontre une pierre au bord d’une rivière.','medium',35,120,4),(626,625,'とうじんポケモン','Ils dirigent les groupes de Scalpion.\nIls se battent pour la suprématie sur le\ngroupe, et les perdants en sont exclus.','medium',35,45,4),(627,626,'ずつきうしポケモン','Son pelage fourni absorbe les chocs\net lui permet d’asséner sans broncher\nle plus violent des coups de tête.','medium',50,45,4),(628,627,'ヒナわしポケモン','They crush berries with their talons. They bravely\nstand up to any opponent, no matter how strong\nit is.','slow',50,190,0),(629,628,'ゆうもうポケモン','Pour les siens, il combat au mépris du\ndanger. Il est capable de soulever\nune voiture haut dans le ciel.','slow',50,60,0),(630,629,'おむつポケモン','Their wings are too tiny to allow them to fly.\nThey guard their posteriors with bones that were\ngathered by Mandibuzz.','slow',35,190,8),(631,630,'ほねわしポケモン','Il construit des nids en os. Il attrape\nles proies affaiblies avec ses serres\net les transporte allègrement au nid.','slow',35,60,8),(632,631,'アリクイポケモン','Il aspire de l’air par la queue et\nentretient un brasier dans son corps.\nC’est le prédateur des Fermite.','medium',50,90,4),(633,632,'てつアリポケモン','Ils portent une armure de fer et se\nregroupent pour contrer les attaques\nde leurs prédateurs, les Aflamanoir.','medium',50,90,4),(634,633,'そぼうポケモン','Il mord tout ce qui bouge, et mange tout\nce qu’il trouve. Il vaut mieux éviter\nde s’en approcher.','slow',35,45,4),(635,634,'らんぼうポケモン','After it has eaten up all the food in its territory,\nit moves to another area. Its two heads do not\nget along.','slow',35,45,4),(636,635,'きょうぼうポケモン','Un Pokémon violent qui patrouille le ciel\navec ses six ailes et se jette sur tout\nce qui bouge, pensant voir un ennemi.','slow',35,45,4),(637,636,'たいまつポケモン','On dit que ce Pokémon serait né du\nsoleil. Lorsqu’il évolue, tout son\ncorps est enveloppé de flammes.','slow',50,45,4),(638,637,'たいようポケモン','On dit que quand le ciel s’est obscurci à\ncause des cendres d’un volcan, le feu\nd’un Pyrax aurait remplacé le soleil.','slow',50,15,4),(639,638,'てっしんポケモン','Un Pokémon légendaire qui a combattu\nles humains pour protéger les Pokémon.\nIl est d’un naturel calme et posé.','slow',35,3,-1),(640,639,'がんくつポケモン','Il a combattu les humains pour protéger\nles Pokémon ayant perdu leur foyer à\ncause de leurs guerres fratricides.','slow',35,3,-1),(641,640,'そうげんポケモン','Il a défié les humains pour protéger\nles siens. Son nom est resté dans\nla légende.','slow',35,3,-1),(642,641,'せんぷうポケモン','Le bas de son corps est entouré d’une\nmasse d’énergie semblable à un nuage.\nIl vole dans le ciel à 300 km/h.','slow',90,3,0),(643,642,'らいげきポケモン','Les terres qu’il a survolées sont\nrecouvertes d’innombrables traces\ndes éclairs qu’il y a fait tomber.','slow',90,3,0),(644,643,'はくようポケモン','Un Pokémon mythique.\nIl projette de sa queue un tourbillon\nde flammes capable de tout emporter.','slow',0,3,-1),(645,644,'こくいんポケモン','Sa queue produit de l’électricité.\nIl dissimule son corps dans un nuage\nélectrique et plane dans le ciel d’Unys.','slow',0,3,-1),(646,645,'ほうじょうポケモン','Il fait fructifier les cultures partout\noù il passe, c’est pourquoi on l’appelle\n“le dieu des moissons”.','slow',90,3,0),(647,646,'きょうかいポケモン','레시라무와 제크로무를 능가할 정도의\n힘을 가졌으나 극저온의\n냉기에 봉인되어 있다.','slow',0,3,-1),(648,647,'わかごまポケモン','Il projette de l’eau depuis ses sabots\net se déplace ainsi à grande vitesse.\nSa botte secrète est le coup de sabot.','slow',35,3,-1),(649,648,'せんりつポケモン','Its melodies are sung with a special vocalization\nmethod that can control the feelings of those who\nhear it.','slow',100,3,-1),(650,649,'こせいだいポケモン','Il y a 300 millions d’années, il était\ncraint comme l’ultime prédateur. Il a\nété modifié par la Team Plasma.','slow',0,3,-1),(651,650,'いがぐりポケモン','ふだん　やわらかい　あたまの　トゲは\nちからを　こめると　するどく　とがり\nいわをも　つらぬくほど　かたくなる。','medium-slow',70,45,1),(652,651,'とげよろいポケモン','からだを　おおう　がんじょうな　カラが\nてきの　こうげきを　はじきかえし\nするどい　トゲで　はんげきする。','medium-slow',70,45,1),(653,652,'とげよろいポケモン','たいあたりで　５０トンの　せんしゃを\nひっくりかえす　パワー。じぶんが\nたてと　なって　なかまを　まもる。','medium-slow',70,45,1),(654,653,'キツネポケモン','こえだを　たべると　げんきになって\nせっし２００どを　こえる　ねっきを\nおおきな　みみから　ふきだす。','medium-slow',70,45,1),(655,654,'キツネポケモン','きのえだを　しっぽに　さしている。\nしっぽの　けの　まさつねつで\nえだに　ひをつけて　たたかう。','medium-slow',70,45,1),(656,655,'キツネポケモン','つえの　せんたんで　もえる　ほのおを\nみつめて　せいしんとういつすると\nみらいの　できごとを　みとおせる。','medium-slow',70,45,1),(657,656,'あわがえるポケモン','むねと　せなかから　あわを　だす。\nだんりょくのある　あわで　こうげきを\nうけとめて　ダメージを　へらす。','medium-slow',70,45,1),(658,657,'あわがえるポケモン','あわで　つつんだ　こいしを　なげる\nわざを　つかう。３０メートル　さきの\nあきかんに　あてる　コントロール。','medium-slow',70,45,1),(659,658,'しのびポケモン','みずを　あっしゅくして　しゅりけんを\nつくりだす。こうそくかいてんさせて\nとばすと　きんぞくも　まっぷたつ。','medium-slow',70,45,1),(660,659,'あなほりポケモン','おおきな　みみで　じめんを　ほって\nすあなを　つくる。ひとばんじゅう\nやすまずに　ほりつづけられる。','medium',50,255,4),(661,660,'あなほりポケモン','おおきな　みみは　１トンを　こえる\nいわを　らくに　もちあげる　パワー。\nこうじげんばで　だいかつやくする。','medium',50,127,4),(662,661,'コマドリポケモン','ひとなつっこい　せいかく。うつくしい\nさえずりと　おばねを　ふる　うごきで\nなかまに　あいずを　おくる。','medium-slow',50,255,4),(663,662,'ひのこポケモン','ひのこを　クチバシから　とばして\nくさむらを　こがし　おどろいて\nとびだした　えものを　つかまえる。','medium-slow',50,120,4),(664,663,'れっかポケモン','主要的獵物是鳥寶可夢。\n會急速接近對手，然後用\n猛烈的腳踢把對手擊落到地面。','medium-slow',50,45,4),(665,664,'こなふきポケモン','とりポケモンに　おそわれると\nくろい　こなを　まきちらす。\nふれると　マヒする　どくのこなだ。','medium',70,255,4),(666,665,'こなふきポケモン','しげみの　かげに　かくれて　くらす。\nてきに　おそわれると　からだの　けを\nするどく　さかだてて　いかくする。','medium',70,120,4),(667,666,'りんぷんポケモン','せかいには　さまざまな　はねもようの\nビビヨンがいる。すんでいる　とちの\nきこうが　えいきょうしているようだ。','medium',70,45,4),(668,667,'わかじしポケモン','つよい　あいてに　たちむかうときほど\nたてがみが　こうおんになり\nぜんしんに　ちからが　みなぎるのだ。','medium-slow',70,220,7),(669,668,'おうじゃポケモン','The male with the largest mane of fire\nis the leader of the pride.','medium-slow',70,65,7),(670,669,'いちりんポケモン','Die Krone auf seinem Kopf hat es sich aus\nPollen von Blumen gebastelt. Sie besitzt eine\nheilende Wirkung.','medium',70,225,8),(671,670,'いちりんポケモン','はなばたけを　とびまわり　かれかけた\nはなを　せわする。はなの　ひめられた\nちからを　ひきだして　たたかう。','medium',70,120,8),(672,671,'ガーデンポケモン','テリトリーは　みごとな　はなぞの。\nくさばなが　はなつ　エネルギーを\nあびて　じぶんの　パワーにするのだ。','medium',70,45,8),(673,672,'ライドポケモン','ひとと　くらすようになった\nさいしょの　ポケモンと　いわれる。\nおだやかな　せいかくの　ポケモン。','medium',70,200,4),(674,673,'ライドポケモン','ツノを　にぎる　わずかな　ちがいから\nトレーナーの　きもちを　よみとるので\nいったいとなって　はしれるのだ。','medium',70,45,4),(675,674,'やんちゃポケモン','Il fait de son mieux pour avoir un air patibulaire,\nmais il sourit béatement dès qu’on lui caresse la tête.','medium',50,220,4),(676,675,'こわもてポケモン','きしょうが　あらく　けんかっぱやいが\nよわいものいじめは　ゆるさない。\nはっぱで　てきの　うごきを　よむ。','medium',50,65,4),(677,676,'プードルポケモン','ボサボサの　たいもうを　かりこむと\nすがたが　うつくしくなる　だけでなく\nからだの　キレが　よくなるのだ。','medium',70,160,4),(678,677,'じせいポケモン','きょうりょくな　サイコパワーが\nもれださないように　ほうしゅつする\nきかんを　みみで　ふさいでいるのだ。','medium',50,190,4),(679,678,'よくせいポケモン','きけんが　せまると　みみを　もちあげ\n１０トン　トラックを　ひねりつぶす\nサイコパワーを　かいほうする。','medium',50,75,4),(680,679,'とうけんポケモン','ししゃの　たましいが　こだいの\nつるぎに　やどって　うまれたらしい。\nひとに　とりつき　いのちを　すう。','medium',50,180,4),(681,680,'とうけんポケモン','しんかして　２ほんに　ぶんれつした。\nテレパシーで　かいわして　れんけい\nこうげきで　てきを　きりきざむ。','medium',50,90,4),(682,681,'おうけんポケモン','れきだいの　おうが　つれていた。\nれいりょくで　ひとや　ポケモンの\nこころを　あやつり　したがわせる。','medium',50,45,4),(683,682,'こうすいポケモン','かいだ　ものを　うっとりさせる\nかおりを　からだから　ただよわせる。\nたべた　もので　かおりが　かわる。','medium',50,200,4),(684,683,'ほうこうポケモン','さまざまな　においを　つくりだす。\nあいての　いやがる　においを　だして\nたたかいを　ゆうりに　すすめるのだ。','medium',50,140,4),(685,684,'わたあめポケモン','わたあめのような　あまくて　ベタつく\nしろい　いとを　だして　あいてを\nからめとり　うごきを　ふうじる。','medium',50,200,4),(686,685,'ホイップポケモン','体臭から　心と　体の\n調子を　嗅ぎとる。　医療への\n応用が　期待されている。','medium',50,140,4),(687,686,'かいてんポケモン','はっこうたいの　てんめつを　みつめた\nあいては　めが　くらみ　たたかう\nきもちが　なくなってしまうのだ。','medium',50,190,4),(688,687,'ぎゃくてんポケモン','ポケモンで　いちばん　きょうりょくな\nさいみんじゅつを　つかう。あいてを\nいのままに　あやつってしまうのだ。','medium',50,80,4),(689,688,'ふたてポケモン','２ひきの　カメテテが　ひとつの\nいわで　くらす。ケンカすると\nどちらかが　ほかの　いわに　うつる。','medium',50,120,4),(690,689,'しゅうごうポケモン','しんかのとき　２ひきの　カメテテが\n７ひきに　ぶんれつした　ポケモン。\n７ひきぶんの　パワーで　たたかう。','medium',50,45,4),(691,690,'クサモドキポケモン','くさった　かいそうに　ぎたいする。\nきづかずに　ちかよってきた　えものに\nどくえきを　あびせて　しとめる。','medium',50,225,4),(692,691,'クサモドキポケモン','タンカーの　せんたいを　くさらせる\nもうどくを　なわばりに　はいりこんだ\nものに　みさかいなく　はきかける。','medium',50,55,4),(693,692,'みずでっぽうポケモン','おおきな　ハサミから　あっしゅくした\nみずを　ピストルのように　うちだし\nとんでいる　えものを　うちおとす。','slow',50,225,4),(694,693,'ランチャーポケモン','みずの　ほうだんを　はっしゃする\nきょだいな　ハサミを　もつ。\nタンカーの　せんたいを　うちぬくぞ。','slow',50,55,4),(695,694,'はつでんポケモン','さばくで　せいかつする。たいようの\nひかりを　あびて　はつでんすれば\nエサを　たべなくても　へいきなのだ。','medium',50,190,4),(696,695,'はつでんポケモン','L’électricité que produit un seul Iguolta en agitant\nsa collerette suffit à alimenter un immeuble entier.','medium',50,75,4),(697,696,'ようくんポケモン','かせきから　ふっかつした　ポケモン。\nきにいらない　ことが　あると\nかんしゃくを　おこして　おおあばれ。','medium',50,45,1),(698,697,'ぼうくんポケモン','ぶあつい　てっぱんを　かみのように\nかみちぎる　おおあごで　こだいの\nせかいでは　むてきを　ほこった。','medium',50,45,1),(699,698,'ツンドラポケモン','１おくねんまえから　こおりづけに\nなっていた　からだの　いちぶから\nふっかつした　こだいの　ポケモン。','medium',50,45,1),(700,699,'ツンドラポケモン','マイナス１５０どの　れいきを\nひしがたの　けっしょうから　だして\nてきを　つつみ　こおりづけにする。','medium',50,45,1),(701,700,'むすびつきポケモン','リボンのような　しょっかくから\nきもちを　やわらげる　はどうを\nおくりこみ　たたかいを　やめさせる。','medium',50,45,1),(702,701,'レスリングポケモン','たいかくは　こがらだが　カイリキーや\nハリテヤマなど　おおきな　ポケモンと\nごかくに　たたかう　テクニシャン。','medium',50,100,4),(703,702,'アンテナポケモン','能用鬍鬚接收來自夥伴們\n的電波，藉此向彼此分享\n哪裡有食物或電力。','medium',50,180,4),(704,703,'ほうせきポケモン','ちかふかくの　こうおん　こうあつな\nかんきょうで　うまれた。あたまの\nいしから　エネルギーを　はなつ。','slow',50,60,-1),(705,704,'なんたいポケモン','Il suo corpo è coperto da una membrana viscida che fa\nscivolare e devia i colpi dei nemici.','slow',35,45,4),(706,705,'なんたいポケモン','なんでも　とかしてしまう　ねんえきを\nぶんぴつして　てきを　げきたいする。\nめだまは　たいかして　みえていない。','slow',35,45,4),(707,706,'ドラゴンポケモン','ひとなつっこい　ドラゴンポケモン。\nだいすきな　トレーナーに　だきついて\nねんえきで　ヌルヌルにしてしまう。','slow',35,45,4),(708,707,'かぎたばポケモン','カギを　あつめる　しゅうせい。\nてきに　おそわれると　ジャラジャラと\nカギを　うちならして　いかくする。','fast',50,75,4),(709,708,'きりかぶポケモン','くさった　きりかぶに　たましいが\nやどり　ポケモンに　なった。\nひとの　よりつかない　もりに　すむ。','medium',50,120,4),(710,709,'ろうぼくポケモン','ほかの　きぎを　じざいに　あやつる。\nもりを　あらす　にんげんは　しぬまで\nもりから　でられないようにするのだ。','medium',50,60,4),(711,710,'かぼちゃポケモン','じょうぶつできない　たましいを\nかぼちゃの　からだに　いれている。\nひぐれと　ともに　うごきはじめる。','medium',50,120,4),(712,711,'かぼちゃポケモン','しんげつの　よるに　ぶきみな　こえで\nうたいながら　まちなかを　さまよう。\nその　うたを　きくと　のろわれる。','medium',50,60,4),(713,712,'ひょうかいポケモン','からだを　おおう　こおりが　てきの\nこうげきを　ふせぐ。わられても\nれいきで　すぐに　こおりを　はる。','medium',50,190,4),(714,713,'ひょうざんポケモン','こおりついた　からだは　こうてつの\nように　かたい。たちふさがる　ものを\nきょたいで　おしつぶし　いどうする。','medium',50,55,4),(715,714,'おんぱポケモン','まっくらな　どうくつで　くらす。\n２０まんヘルツの　ちょうおんぱを\nおおきな　みみから　はっしゃする。','medium',50,190,4),(716,715,'おんぱポケモン','つきあかりすら　ない　やみよを　とび\nゆだんしている　えものを　おそう。\nくらやみの　たたかいでは　むてきだ。','medium',50,45,4),(717,716,'せいめいポケモン','えいえんの　いのちを　わけあたえると\nいわれている。じゅもくの　すがたで\n１０００ねん　ねむり　ふっかつする。','slow',0,45,-1),(718,717,'はかいポケモン','つばさと　おばねを　ひろげて　あかく\nかがやくとき　いきものの　いのちを\nすいとる　でんせつの　ポケモン。','slow',0,45,-1),(719,718,'ちつじょポケモン','カロスちほうの　せいたいけいが\nくずれると　すがたを　あらわして\nひめた　ちからを　はっきするらしい。','slow',0,3,-1),(720,719,'ほうせきポケモン','メレシーの　とつぜんへんい。\nピンクいろに　かがやく　からだは\nせかいいち　うつくしいと　いわれる。','slow',50,3,-1),(721,720,'いたずらポケモン','くうかんを　ゆがめる　リングで\nあらゆる　ものを　はなれた　ばしょへ\nとばしてしまう　トラブルメーカー。','slow',100,3,-1),(722,721,'スチームポケモン','Expulsa vapor y desaparece entre la densa niebla. Dicen que\nhabita en montañas solitarias.','slow',100,3,-1),(723,722,'くさばねポケモン','けいかいしんが　つよい。　ひるは\nこうごうせいで　ちからを　ためて\nよるに　なったら　かつどうかいし。','medium-slow',50,45,1),(724,723,'はばねポケモン','きどりやで　ひまが　あれば　つばさの\nていれ。　うもうの　よごれが　きに\nなりすぎて　たたかえないことも。','medium-slow',50,45,1),(725,724,'やばねポケモン','つばさに　しこまれた　やばねを\nつがえてはなつ。　１００メートルさきの\nこいしも　つらぬく　せいど。','medium-slow',50,45,1),(726,725,'ひねこポケモン','けづくろいで　おなかに　たまった\nぬけげを　もやして　ひを　ふく。\nけの　はきかたで　ほのおも　へんか。','medium-slow',50,45,1),(727,726,'ひねこポケモン','くびの　つけねに　ほのおの　スズが\nある。　ほのおが　ふきだすとき\nリンリンと　たかいおとが　なる。','medium-slow',50,45,1),(728,727,'ヒールポケモン','강렬한 펀치와 킥을\n가한 후 배꼽 부근에서\n불꽃을 뿜어내 마무리한다.','medium-slow',50,45,1),(729,728,'あしかポケモン','がんばりやな　せいしつで　ゆうめい。\nたいえきを　はなで　ふくらませた\nバルーンを　てきに　ぶつける。','medium-slow',50,45,1),(730,729,'アイドルポケモン','ダンスが　とくいで　おどりながら\nつぎつぎに　みずの　バルーンを\nつくりだし　てきに　ぶつけるぞ。','medium-slow',50,45,1),(731,730,'ソリストポケモン','みずのバルーンを　うたで　あやつる。\nそのメロディは　なかまに　まなび\nだいだい　むれに　ひきつがれていく。','medium-slow',50,45,1),(732,731,'きつつきポケモン','びょうかん１６れんだ　で　きを　つつき\nあなを　ほる。　あけた　あなは　エサを\nしまう　ちょぞうこや　すに　つかう。','medium',70,255,4),(733,732,'ラッパぐちポケモン','クチバシに　くった　きのみの　タネを\nためこむ。　てきや　えものに\nであうと　いっきに　はっしゃする。','medium',70,120,4),(734,733,'おおづつポケモン','クチバシを　はつねつさせ　たたかう。\nそのおんどは　１００どを　ゆうに　こえ\nつつかれるだけで　おおやけど。','medium',70,45,4),(735,734,'うろつきポケモン','무엇이든 먹지만 신선하고\n살아 있는 것을 좋아해서\n먹이를 찾아 길을 누비고 다닌다.','medium',70,255,4),(736,735,'はりこみポケモン','えものの　こんせきを　みつけると\nねばりづよく　そのばに　はりこむが\nひぐれには　うつらうつら　している。','medium',70,127,4),(737,736,'ようちゅうポケモン','じょうぶな　アゴで　じゅもくを\nけずり　じゅえきを　すする。\nふだんは　じめんの　なかで　くらす。','medium',50,255,4),(738,737,'バッテリーポケモン','たいないに　ちくでんきのうを　もつ。\nキャンプの　ときなど　１ぴき　いると\nとても　ありがたい　ポケモンだ。','medium',50,120,4),(739,738,'くわがたポケモン','腹部有著發電器官，\n會將能量集中在大顎上，\n發出驚人的電擊。','medium',50,45,4),(740,739,'けんとうポケモン','ハサミで　じゃくてんを　ガードしつつ\nスキを　うかがい　パンチを　はなつ。\nまけたほうは　アワを　ふいて　ダウン。','medium',70,225,4),(741,740,'けがにポケモン','トップを　めざすはずが　ゆきやまに\nまよいのぼり　さむさに　たえるうちに\nけが　はえてきて　しんかしていた。','medium',70,60,4),(742,741,'ダンスポケモン','はねを　うちあわせて　はっか。\nかれいな　ステップを　ふみながら\nはげしい　ほのおを　あびせかけるぞ。','medium',70,45,6),(743,742,'ツリアブポケモン','はなのミツや　かふんが　エサ。\nオーラを　かんじる　ちからを　もち\nさきそうな　はなを　みわけている。','medium',50,190,4),(744,743,'ツリアブポケモン','かふんを　まるめ　だんごを　つくる。\nしょくよう　から　せんとうよう　まで\nたくさんの　しゅるいが　あるよ。','medium',50,75,4),(745,744,'こいぬポケモン','よく　なつくので　しょしんしゃに\nおすすめのポケモンと　いわれるが\nそだつと　きしょうは　あらくなる。','medium',50,190,4),(746,745,'オオカミポケモン','すばやく　うごき　てきを　まどわす。\nツメや　キバの　ほか　タテガミの\nとがった　いわも　ぶきの　ひとつ。','medium',50,90,4),(747,746,'こざかなポケモン','ピンチになると　めが　うるみだし\nかがやく。　そのひかりに　むれる\nなかまと　てきに　たちむかうのだ。','fast',50,60,4),(748,747,'ヒトデナシポケモン','あたまに　ある　どくトゲで　えものを\nズブリ。よわったところを　１０ぽんの\nしょくしゅで　とらえ　とどめを　さす。','medium',50,190,4),(749,748,'ヒトデナシポケモン','１２ほんのあしで　かいていを　はう。\nドヒドイデの　はったあとには\nサニーゴのカスが　ちらばっている。','medium',50,75,4),(750,749,'うさぎうまポケモン','最喜歡玩泥巴。\n如果沒有每天到泥巴裡玩的話，\n會因為壓力累積而變得不聽話。','medium',50,190,4),(751,750,'ばんばポケモン','从嘴里吐出的泥凝固后，\n即便是风雨也能经得住，\n所以常被涂在以前家里的外墙上。','medium',50,60,4),(752,751,'すいほうポケモン','エサを　もとめ　ちじょうに　あがる。\nすいほうを　かぶるのは　こきゅうと\nやわらかい　あたまを　まもるため。','medium',50,200,4),(753,752,'すいほうポケモン','とうぶの　すいほうで　ヘッドバット。\nちいさなポケモンで　あれば　そのまま\nすいほうに　とりこまれ　おぼれしぬ。','medium',50,100,4),(754,753,'かまくさポケモン','ひるまは　ひかりをあびて　ねむり\nよるに　なると　より　あんぜんな\nねどこを　さがし　あるきだす。','medium',50,190,4),(755,754,'はなかまポケモン','あざやかな　たいしょくを　たもつには\nひじょうに　てまが　かかるが　それを\nしゅみにする　こうずかも　いるのだ。','medium',50,75,4),(756,755,'はっこうポケモン','てんめつしながら　ひかる　ほうしを\nあたりに　ばらまく。　そのひかりを\nみたものは　ふかいねむりに　おちる。','medium',50,190,4),(757,756,'はっこうポケモン','よなかに　マシェードのすむ　もりに\nいくのは　きけん。　あやしいひかりに\nまどわされ　にどと　かえれなくなる。','medium',50,75,4),(758,757,'どくトカゲポケモン','たいえきを　もやし　どくガスを　たく。\nガスを　すった　てきが　フラフラに\nなったあと　おそいかかるのだ。','medium',50,120,1),(759,758,'どくトカゲポケモン','なぜか　♀しか　みつかっていない。\nヤトウモリの　♂を　ひきつれて\nぎゃくハーレムを　つくって　くらす。','medium',50,45,8),(760,759,'じたばたポケモン','あいくるしい　みためだが　おこって\nジタバタする　てあしに　ぶつかると\nプロレスラーでも　ふっとばされる。','medium',50,140,4),(761,760,'ごうわんポケモン','あっとうてきな　きんりょくを　もつ\nひじょうに　きけんな　ポケモン。\nせいそくちは　きほん　たちいりきんし。','medium',50,70,4),(762,761,'フルーツポケモン','おいしそうな　かおりが　からだから\nもれだしている。　においに　さそわれた\nドデカバシに　まるのみに　される。','medium-slow',50,235,8),(763,762,'Pokémon Frutto','みを　まもるため　ヘタが　はったつ。\nかなりの　かたさで　とりポケモンに\nつつかれても　ぜんぜん　へいきだ。','medium-slow',50,120,8),(764,763,'フルーツポケモン','あしを　いかした　けりが　とくい。\nたおした　あいてを　あしげに　して\nたかわらいで　しょうりを　アピール。','medium-slow',50,45,8),(765,764,'はなつみポケモン','えいようまんてんの　ツルに　はなを\nくっつける。　はなは　かっせいかし\nかぐわしい　アロマが　ただよいだす。','fast',50,60,6),(766,765,'けんじゃポケモン','ひじょうに　かしこいことで　しられる。\nみじゅくな　トレーナーは　みくだす\nベテランむけの　ポケモンだぞ。','slow',50,45,4),(767,766,'れんけいポケモン','２０ぴきぜんごの　グループを　つくる。\nそのけっそくは　ひじょうに　かたく\nぜったい　なかまを　みすてない。','slow',50,45,4),(768,767,'そうこうポケモン','おくびょうで　たくさんの　あしを\nばたつかせ　ひっしに　にげまわる。\nにげたあとは　ピカピカ　きれい。','medium',50,90,4),(769,768,'そうこうポケモン','するどく　きょだいな　ツメで\nいっせん。　くうきや　かいすいさえ\nいっとうりょうだんの　うでまえ。','medium',50,45,4),(770,769,'すなやまポケモン','いきだおれたものの　おんねんが\nこどもが　つくった　すなやまに\nとりつき　たんじょう　したのだ。','medium',50,140,4),(771,770,'すなのしろポケモン','ひとを　あやつり　すなのやまを\nすなのしろまで　しんか　させた。\nのろいの　ちからも　あがっている。','medium',50,60,4),(772,771,'なまこポケモン','It’s covered in a slime that keeps its skin moist,\nallowing it to stay on land for days without\ndrying up.','fast',50,60,4),(773,772,'じんこうポケモン','おもい　せいぎょマスクを　つけており\nほんらいの　のうりょくを　だせない。\nとくべつな　ちからを　ひめている。','slow',0,3,-1),(774,773,'じんこうポケモン','パートナーとの　しんらいで　かくせい。\nじざいに　タイプを　チェンジする\nのうりょくを　はっきし　たたかう。','slow',0,3,-1),(775,774,'ながれぼしポケモン','もともと　オゾンそうに　すんでおり\nからだの　カラが　おもくなると\nちじょうに　むかって　おちてくる。','medium-slow',70,30,-1),(776,775,'ゆめうつつポケモン','ねたまま　うまれ　ねたまま　しぬ。\nすべての　こうどうは　みている\nゆめに　よる　ねぞう　らしい。','slow',70,45,4),(777,776,'ばくはつがめポケモン','せなかの　こうらは　ばくはつぶつ。\nうっかり　なぐれば　だいばくはつ。\nおなかの　あなが　じゃくてん。','medium',50,70,4),(778,777,'まるまりポケモン','せなかの　ハリの　けは　ふだんは\nねている。　こうふんすると　さかだち\nおそってくる　てきを　つきさすのだ。','medium',50,180,4),(779,778,'ばけのかわポケモン','しょうたいふめい。　ボロきれの\nなかみを　みた　とある　がくしゃは\nきょうふの　あまり　ショックしした。','medium',50,45,4),(780,779,'はぎしりポケモン','あたまの　とっきから　サイコパワーを\nはなつとき　とても　みみざわりな\nはぎしりの　おとが　あたりに　ひびく。','medium',70,80,4),(781,780,'ゆうゆうポケモン','こころやさしい　せいしつ。　だが\nいちど　いかりに　かられると　はげしい\nいぶきで　あたりを　はかい　しつくす。','medium',50,70,4),(782,781,'もくずポケモン','でかい　イカリを　ブンブン　ふりまわし\nホエルオーさえ　いちげきで　ＫＯ。\nみどりの　モズクが　ほんたいだ。','medium',50,25,-1),(783,782,'うろこポケモン','ウロコを　たたき　きもちを　つたえる。\nジャラコの　すむ　こうざんでは\nきんぞくおんが　こだまする。','slow',50,45,4),(784,783,'うろこポケモン','おたけびと　ともに　えものに\nとびかかる。　ウロコの　パンチは\nあいてを　ズタズタに　ひきさくぞ。','slow',50,45,4),(785,784,'うろこポケモン','遇到敵人便會敲響尾部的\n鱗片來威嚇對方。只會與\n不畏懼自己的強者戰鬥。','slow',50,45,4),(786,785,'とちがみポケモン','こうきしんおうせいな　メレメレの\nまもりがみ。　かみなりぐもを　よび\nいかずちを　からだに　ためこむ。','slow',50,3,-1),(787,786,'とちがみポケモン','むじゃきで　ざんこくな　アーカラの\nまもりがみ。　はなの　かぐわしい\nかおりが　エネルギーの　みなもと。','slow',50,3,-1),(788,787,'とちがみポケモン','たいぼくを　ひきぬき　ブンブン\nふりまわす。　くさきを　しげらせて\nそのエネルギーを　きゅうしゅうする。','slow',50,3,-1),(789,788,'とちがみポケモン','ふかいきりで　てきを　まどわせ\nじめつさせる　おそろしさを　もつ。\nかいりゅうが　エネルギーの　みなもと。','slow',50,3,-1),(790,789,'せいうんポケモン','はかない　ガスじょうの　からだ。\nたいきの　チリを　あつめながら\nゆっくりと　せいちょうしていく。','slow',0,45,-1),(791,790,'げんしせいポケモン','しんだように　まったく　うごかないが\nふれると　ほのかに　あたたかい。\nおおむかしは　ほしのマユと　よばれた。','slow',0,45,-1),(792,791,'にちりんポケモン','べつせかいに　すむと　いわれる。\nぜんしんから　はげしいひかりを　はなち\nやみよも　まひるのように　てらすのだ。','slow',0,45,-1),(793,792,'がちりんポケモン','Si dice che viva in un altro mondo.\nAssorbe la luce facendo calare le tenebre anche\nsulle giornate più luminose.','slow',0,45,-1),(794,793,'きせいポケモン','なぞに　つつまれた　ＵＢの　いっしゅ。\nまちゆく　ひとが　きせいされ\nあばれだす　すがたが　もくげきされた。','slow',0,45,-1),(795,794,'ぼうちょうポケモン','べつせかいから　あらわれた　ＵＢ。\nみずからの　からだを　みせつけてくるが\nじまんなのか　いかくなのか　ふめい。','slow',0,45,-1),(796,795,'えんびポケモン','きけんなＵＢの　いっしゅ。　すさまじい\nそくどで　だいちを　しっそうする\nすがたが　もくげき　されている。','slow',0,45,-1),(797,796,'でんしょくポケモン','ぜんしんから　すさまじい　でんげきを\nほとばしらせる　こうけいを　もくげき。\nなぞの　せいぶつ　ＵＢの　いっしゅだ。','slow',0,45,-1),(798,797,'うちあげポケモン','ウルトラホールから　あらわれた。\nこうそくで　そらを　とぶ　すがたが\nもくげき　された　ウルトラビースト。','slow',0,45,-1),(799,798,'ばっとうポケモン','ウルトラホールから　あらわれた　ＵＢ。\nみずから　てきを　おそわないようだが\nするどい　ぜんしんは　きょうきだ。','slow',0,45,-1),(800,799,'あくじきポケモン','やまを　くらい　けずり　ビルを\nのみこむ　すがたが　ほうこく　された。\nウルトラビーストの　いっしゅ。','slow',0,45,-1),(801,800,'プリズムポケモン','光似乎是牠的能量來源。\n毫無節制地不停發射雷射，\n性格非常凶暴。','slow',0,255,-1),(802,801,'じんぞうポケモン','５００ねんいじょうまえに　つくられた\nじんぞうポケモン。　ひとの　ことばを\nりかいするが　しゃべれない。','slow',0,3,-1),(803,802,'かげすみポケモン','かげのなかに　ひそむことが　でき\nひとまえに　すがたを　みせないので\nそのそんざいは　まぼろし　だった。','slow',0,3,-1),(804,803,'どくばりポケモン','いせかいに　おいては　たびだちの\nパートナーに　えらばれるほど\nしたしまれている　ウルトラビースト。','slow',0,45,-1),(805,804,'どくばりポケモン','たいないに　すうひゃくリットルの\nどくえきを　ためている。　ＵＢと\nよばれる　せいぶつの　いっしゅ。','slow',0,45,-1),(806,805,'いしがきポケモン','ウルトラホールから　しゅつげんした。\nふくすうの　せいめいが　つみあがり\n１ぴきを　けいせいしている　ようだ。','slow',0,30,-1),(807,806,'はなびポケモン','クネクネうごいて　ひとに　ちかづくと\nとつぜん　あたまを　ばくはつさせた。\nウルトラビーストの　いっしゅらしい。','slow',0,30,-1),(808,807,'じんらいポケモン','りょうてあしの　ツメを　たいでんさせ\nあいてを　やつざき。　かわされても\nとびちる　でんげきで　かんでんさせる。','slow',0,3,-1),(809,808,'ナットポケモン','とろりと　とけた　はがねの　からだ。\nちちゅうの　てつぶんや　きんぞくを\nとかして　きゅうしゅうする。','slow',0,3,-1),(810,809,'ナットポケモン','てつを　うみだす　ちからを　もつと\nあがめられていた。　３０００ねんの\nときを　へて　なぜか　よみがえった。','slow',0,3,-1),(811,810,'こざるポケモン','とくべつな　スティックで　リズムを\nきざむと　くさばなを　げんきにする\nパワーが　おんぱになって　ひろがる。','medium-slow',50,45,1),(812,811,'ビートポケモン','２ほんの　スティックで　はげしい\nビートを　きざめる　バチンキーほど\nなかまたちの　そんけいを　あつめる。','medium-slow',50,45,1),(813,812,'ドラマーポケモン','とくべつな　きりかぶの　パワーを\nドラミングで　コントロール。\nねっこを　あやつって　たたかう。','medium-slow',50,45,1),(814,813,'うさぎポケモン','はしりまわって　たいおんを　あげると\nほのおエネルギーが　からだを　めぐり\nほんらいの　ちからを　はっきできる。','medium-slow',50,45,1),(815,814,'うさぎポケモン','ふかふかの　たいもうで　さむさに\nつよくなり　さらに　こうおんの\nほのおわざを　だせるようになった。','medium-slow',50,45,1),(816,815,'ストライカーポケモン','こいしを　リフティングして　ほのおの\nサッカーボールを　つくる。　するどい\nシュートで　あいてを　もやす。','medium-slow',50,45,1),(817,816,'みずとかげポケモン','おびえると　タマネギ１００コぶんの\nさいるいせいぶんを　もつ　なみだを\nながして　もらいなき　させる。','medium-slow',50,45,1),(818,817,'みずとかげポケモン','ての　ひらから　でる　すいぶんを\nまるめて　つくった　みずの　たまを\nつかい　ずのうせんを　くりひろげる。','medium-slow',50,45,1),(819,818,'エージェントポケモン','たさいな　きのうを　かくしもつ。\nゆびから　みずを　ふんしゃして\nせなかの　ひまくで　かぜに　のる。','medium-slow',50,45,1),(820,819,'ほおばりポケモン','ガラルの　いたるところに　いる。\nさゆうの　ほっぺに　きのみを\nたくわえていないと　ふあん。','medium',50,255,4),(821,820,'よくばりポケモン','Sus incisivos, de fuerza y dureza extraordinarias,\nle permiten mordisquear incluso las bayas más\nduras. Es un Pokémon muy común en Galar.','medium',50,90,4),(822,821,'ことりポケモン','どんな　きょうてきにも　いどみかかる\nゆうかんな　せいしつ。　かえりうちに\nあいながらも　きたえられていく。','medium-slow',50,255,4),(823,822,'カラスポケモン','あしで　こいしを　つかんで　なげたり\nロープを　てきに　まきつけるなど\nどうぐを　あつかう　ちえを　もつ。','medium-slow',50,120,4),(824,823,'カラスポケモン','ガラルちほうの　そらでは　てきなし。\nくろびかりする　はがねの　すがたは\nあいてを　いあつし　おそれさせる。','medium-slow',50,45,4),(825,824,'ようちゅうポケモン','いつも　せっせと　じょうほうを\nあつめているので　かしこい。\nただし　ちからは　いまいちだ。','medium',50,255,4),(826,825,'レドームポケモン','ほぼ　うごかないが　いきている。\nのまずくわずで　からに　こもるうち\nちょうのうりょくに　めざめたらしい。','medium',50,120,4),(827,826,'ななほしポケモン','かしこい　ポケモンとして　ゆうめい。\nおおきな　のうみそは　きょうりょくな\nサイコパワーを　もつ　あかし。','medium',50,45,4),(828,827,'きつねポケモン','ほかの　ポケモンが　みつけた　エサを\nかすめて　くらしている。　ふかふかの\nにくきゅうは　あしおとを　たてない。','fast',50,255,4),(829,828,'きつねポケモン','ねらった　エモノは　こっそり\nマーキング。　においを　たどって\nゆだん　したころ　ぬすみに　くるぞ。','fast',50,127,4),(830,829,'はなかざりポケモン','いっぽんあしを　じめんに　さして\nひのひかりを　たっぷり　あびると\nはなびらが　あざやかに　いろづく。','medium',50,190,4),(831,830,'わたかざりポケモン','わたげの　タネは　えいようまんてん。\nかぜに　のせて　とばして　くさきや\nポケモンたちを　げんきにさせる。','medium',50,75,4),(832,831,'ひつじポケモン','パーマの　かかった　たいもうは\nたかい　クッションせいが　ある。\nがけから　おちても　へっちゃら。','medium',50,255,4),(833,832,'ひつじポケモン','だんりょくの　ある　けで　おった\nカーペットは　トランポリンみたいで\nのれば　ピョンピョン　はねるのだ。','medium',50,127,4),(834,833,'くいつきポケモン','めのまえの　ものに　すぐに　かみつく\nしゅうせい。　はえかけの　まえばが\nかゆいので　かみついてしまうらしい。','medium',50,255,4),(835,834,'かみつきポケモン','きょうぼうな　せいしつ。　てつぼうを\nかみちぎる　ほどの　アゴの　ちからで\nえものに　ばくりと　かみつく。','medium',50,75,4),(836,835,'こいぬポケモン','はしる　ときに　しっぽの　ねもとから\nでんきを　うみだす。　ガラルでは\nぼくようけん　として　にんき。','fast',50,255,4),(837,836,'いぬポケモン','でんきを　つくって　あしに　おくり\nはしりを　アシスト。　みっかみばん\nやすまず　はしれるのだ。','fast',50,45,4),(838,837,'せきたんポケモン','およそ４００ねんまえに　たんこうで\nみつかった。　からだの　ほとんどが\nせきたんと　おなじ　せいぶん。','medium-slow',50,255,4),(839,838,'せきたんポケモン','たいないで　せきたんを　つくりだす。\nむかしの　ガラルでは　おとした\nせきたんを　せいかつに　りようした。','medium-slow',50,120,4),(840,839,'せきたんポケモン','平时性情温和，但在人类\n破坏矿山时会大发雷霆，\n用１５００度的大火将他们烧尽。','medium-slow',50,45,4),(841,840,'りんごぐらしポケモン','いっしょう　りんごの　なかで　くらし\nてんてきの　とりポケモンに　であうと\nりんごの　ふりをして　みをまもる。','slow-then-very-fast',50,255,4),(842,841,'りんごはねポケモン','すっぱい　りんごを　たべて　しんか。\nやけどする　ほど　きょうさんせいの\nえきたいを　ほほぶくろに　ためる。','slow-then-very-fast',50,45,4),(843,842,'りんごじるポケモン','あまい　りんごを　たべて　しんか。\nからだから　あまい　においを　だして\nエサの　むしポケモンを　ひきよせる。','slow-then-very-fast',50,45,4),(844,843,'すなへびポケモン','あなを　ほりながら　たべた　すなを\nくびの　ふくろに　ためている。\n８キロもの　すなが　はいるのだ。','medium',50,255,4),(845,844,'すなへびポケモン','ぜんしんを　ちぢめ　１００キロの\nすなを　はなの　あなから　ふんしゃ。\nすなが　ないと　よわきに　なるぞ。','medium',50,120,4),(846,845,'うのみポケモン','あいてを　いちげきで　うちまかすほど\nパワフルだが　わすれっぽいので\nたたかっている　あいてを　わすれる。','medium',50,45,4),(847,846,'とつげきポケモン','するどく　とがった　あごが　じまん。\nすこしでも　うごくものを　みつけると\nいっちょくせんに　とつげきする。','slow',50,255,4),(848,847,'くしざしポケモン','やりの　ように　とがった　あごは\nはがねの　かたさ。　その　みは\nおどろくほど　おいしい　らしい。','slow',50,60,4),(849,848,'あかごポケモン','たいないの　どくぶくろに　ためた\nどくそを　ひふから　ぶんぴつ。\nさわると　ピリピリと　しびれる。','medium-slow',50,75,4),(850,849,'パンクポケモン','むねの　とっきを　かきむしり\nでんきを　おこすとき　あたりに\nギターのような　おとが　ひびく。','medium-slow',50,45,4),(851,850,'はつねつポケモン','からだに　ためた　かねんガスで\nはつねつ。　とくに　おなかの\nきいろい　ぶぶんが　あついのだ。','medium',50,190,4),(852,851,'はつねつポケモン','はつねつじの　たいおんは　およそ\n８００ど。　からだを　ムチのように\nしならせて　とびかかってくるぞ。','medium',50,75,4),(853,852,'だだっこポケモン','えさを　もとめ　ちじょうに　あがる。\nこうきしんおうせいで　めにしたものは\nとりあえず　しょくしゅで　なぐる。','medium-slow',50,180,4),(854,853,'じゅうじゅつポケモン','ぜんしんが　きんにくの　かたまり。\nしょくしゅを　つかって　くりだす\nしめわざの　いりょくは　すさまじい。','medium-slow',50,45,4),(855,854,'こうちゃポケモン','のこされ　ひえきった　こうちゃに\nさみしがりやな　たましいが　やどり\nポケモンに　なったと　いわれている。','medium',50,120,-1),(856,855,'こうちゃポケモン','アンティークの　ポットに　すみつく。\nほとんどが　がんさくだが　ごくまれに\nしんさくが　みつかる　ことも。','medium',50,60,-1),(857,856,'おだやかポケモン','あたまの　とっきで　せいぶつの\nきもちを　かんじとる。　おだやかな\nものにしか　こころを　ひらかない。','slow',50,235,8),(858,857,'せいしゅくポケモン','つよい　かんじょうを　もつ　ものは\nそれが　だれであれ　だまらせる。\nそのしゅだんは　じつに　らんぼう。','slow',50,120,8),(859,858,'せいじゃくポケモン','ずつうになるほどの　サイコパワーを\nしゅういに　はなって　ほかの\nせいぶつを　とおざけているのだ。','slow',50,45,8),(860,859,'いじわるポケモン','ひとや　ポケモンが　いやがる　ときに\nはっする　マイナスエネルギーを\nはなから　すいこみ　げんきになる。','medium',50,255,0),(861,860,'しょうわるポケモン','どげざして　あやまる　ふりをして\nやりのように　とがった　うしろがみで\nつきさしてくる　せんぽうを　つかう。','medium',50,120,0),(862,861,'ビルドアップポケモン','かみのけを　ぜんしんに　まきつけると\nきんりょくが　アップ。　カイリキーを\nねじふせる　パワーを　はっきする。','medium',50,45,0),(863,862,'ていしポケモン','すさまじい　せいりょうを　もつ。\nシャウトとともに　いかくするさまは\nブロッキングと　よばれている。','medium',50,45,4),(864,863,'バイキングポケモン','あたまの　たいもうが　こうしつかして\nてつの　ヘルメットのように　なった。\nとても　こうせんてきな　せいしつ。','medium',50,90,4),(865,864,'さんごポケモン','れいりょくが　たかまり　カラから\nときはなたれた。　れいたいで\nかくの　たましいを　まもっている。','fast',50,30,6),(866,865,'かるがもポケモン','れきせんを　いきぬいた　ものが\nこのすがたに　しんかする。　ネギが\nかれるとき　せんじょうを　さる。','medium',50,45,4),(867,866,'コメディアンポケモン','タップダンスの　たつじん。\nこおりで　できた　ステッキを　ふり\nかろやかな　ステップを　ひろうする。','medium',50,45,4),(868,867,'おんねんポケモン','つよい　のろいを　こめて　かかれた\nこだいの　えが　デスマスの\nたましいを　とりこみ　うごきだした。','medium',50,90,4),(869,868,'クリームポケモン','クリームで　できた　からだを　もつ。\nくうきちゅうの　あまい　かおりの\nせいぶんが　あつまって　うまれた。','medium',50,200,8),(870,869,'クリームポケモン','しんらいする　トレーナーには\nクリームで　デコレーションした\nきのみを　ふるまって　くれるのだ。','medium',50,100,8),(871,870,'じんけいポケモン','ヘイチョーと　よばれる　１ぴきと\nヘイと　よばれる　５ひきで　ひとつ。\nヘイチョーの　めいれいは　ぜったい。','medium',50,45,-1),(872,871,'うにポケモン','トゲの　さきから　でんきを　はなつ。\nするどい　はで　いわに　ついた\nかいそうを　こそいで　たべる。','medium',50,75,4),(873,872,'いもむしポケモン','れいきの　まざった　いとを　はく。\nいとで　からだを　えだに　まきつけ\nつららの　ふりをして　ねむるのだ。','medium',50,190,4),(874,873,'こおりがポケモン','はねの　おんどは　マイナス１８０ど。\nれいきを　こめた　りんぷんを　ゆきの\nように　ふりまき　のやまを　とぶ。','medium',50,75,4),(875,874,'きょせきポケモン','だいそうげんの　なかで　たたずみ\nひの　かたむきを　ながめて　くらす。\nダイナミックな　けりわざが　とくい。','slow',50,60,4),(876,875,'ペンギンポケモン','とても　さむい　ばしょから　ながれ\nながされ　やってきた。　こおりで\nかおを　つねに　ひやして　いるのだ。','slow',50,60,4),(877,876,'かんじょうポケモン','あたまの　ツノで　あいての　きもちを\nかんじとる。　オスは　じゅうしゃの\nように　あるじのそばで　せわをやく。','fast',140,30,4),(878,877,'にめんポケモン','いつも　おなかを　すかせている。\nポケットの　ような　ふくろに　いれた\nタネを　たべて　でんきを　つくる。','medium',50,180,4),(879,878,'どうぞうポケモン','５トンの　にもつを　もっても\nへいきな　ちからもち　ポケモン。\nはなを　つかって　つちを　ほる。','medium',50,190,4),(880,879,'どうぞうポケモン','みどりのひふは　みずにも　つよい。\nむかし　ほかのとちから　やってきて\nひとと　いっしょに　はたらいた。','medium',50,90,4),(881,880,'かせきポケモン','こだいでは　たくましい　かはんしんで\nむてきだったが　エサの　しょくぶつを\nたべつくしてしまい　ぜつめつした。','slow',50,45,-1),(882,881,'かせきポケモン','こおりづけの　じょうはんしんが\nふるえると　でんきが　つくられる。\nあるくことが　ひじょうに　にがて。','slow',50,45,-1),(883,882,'かせきポケモン','ずばぬけた　きゃくりょくと　アゴの\nちからで　こだいでは　むてきだったが\nえものを　とりつくし　ぜつめつした。','slow',50,45,-1),(884,883,'かせきポケモン','しゅういを　こおりつかせて　えものを\nつかまえるが　くちが　あたまの\nうえに　あるので　たべづらい。','slow',50,45,-1),(885,884,'ごうきんポケモン','みがきあげた　きんぞくの　ような\nからだは　かるいうえに　かたいが\nさびやすいのが　けってんなのだ。','medium',50,45,4),(886,885,'うらめしポケモン','こだいの　うみで　くらしていた。\nゴーストポケモンとして　よみがえり\nかつての　すみかを　さまよっている。','slow',50,45,4),(887,886,'せわやくポケモン','ひこう　そくどは　じそく２００キロ。\nドラメシヤと　いっしょに　たたかい\nぶじに　しんかするまで　せわをする。','slow',50,45,4),(888,887,'ステルスポケモン','ツノの　あなに　ドラメシヤを　いれて\nくらす。　たたかいになると　マッハの\nスピードで　ドラメシヤを　とばす。','slow',50,45,4),(889,888,'つわものポケモン','でんせつの　えいゆうと　よばれる\nポケモン。　きんぞくを　とりこみ\nぶぐに　へんかさせ　たたかう。','slow',0,10,-1),(890,889,'つわものポケモン','ひとのおうと　ちからを　あわせ\nガラルを　すくった　ポケモン。\nきんぞくを　とりこみ　たたかう。','slow',0,10,-1),(891,890,'キョダイポケモン','むねの　コアが　ガラルちほうの\nだいちから　わきだす　エネルギーを\nきゅうしゅうして　かつどうしている。','slow',0,255,-1),(892,891,'けんぽうポケモン','きびしい　たんれんを　つみ　わざを\nみがく。　たいとくした　わざによって\nしんかしたときに　すがたが　かわる。','slow',50,3,1),(893,892,'けんぽうポケモン','いちげきひっさつが　しんじょう。\nあいての　ふところに　とびこみ\nきたえられた　こぶしを　たたきこむ。','slow',50,3,1),(894,893,'わるざるポケモン','むれを　つくり　みつりんで　くらす。\nとても　こうげきてきで　もりにすむ\nポケモンたちから　おそれられている。','slow',0,3,-1),(895,894,'エレクトロンポケモン','でんきエネルギーの　かたまり。\nからだの　リングを　はずすと　ひめた\nちからが　ときはなたれるらしい。','slow',35,3,-1),(896,895,'りゅうぎょくポケモン','うでの　かたちは　こだいの　ドラゴン\nポケモンの　あたまという　がくせつも\nあるが　しょうめいされていない。','slow',35,3,-1),(897,896,'あばれうまポケモン','ひづめから　きょうりょくな　れいきを\nはなつ。　ほしいものは　なんでも\nちからずくで　うばう　あばれんぼう。','slow',35,3,-1),(898,897,'しゅんばポケモン','しかく　いがいの　ごかんを　つかい\nようすを　さぐる。　けられたものは\nたましいを　ぬかれてしまうという。','slow',35,3,-1),(899,898,'キングポケモン','いやしと　めぐみの　ちからを　もつ\nじあいに　みちた　ポケモン。　はるか\nむかし　ガラルに　くんりんしていた。','slow',100,3,-1),(900,899,'おおツノポケモン','The black orbs shine with an uncanny light when the Pokémon is\nerecting invisible barriers. The fur shed from its beard retains\nheat well and is a highly useful material for winter clothing.','slow',NULL,135,4),(901,900,'まさかりポケモン','A violent creature that fells towering trees with its crude axes\nand shields itself with hard stone. If one should chance upon\nthis Pokémon in the wilds, one\'s only recourse is to flee.','medium',NULL,115,4),(902,901,'でいたんポケモン','I believe it was Hisui\'s swampy terrain that gave Ursaluna its\nburly physique and newfound capacity to manipulate peat\nat will.','medium',NULL,75,4),(903,902,'おおうおポケモン','Clads itself in the souls of comrades that perished before\nfulfilling their goals of journeying upstream. No other species\nthroughout all Hisui\'s rivers is Basculegion\'s equal.','medium',NULL,135,4),(904,903,'クライミングポケモン','Because of Sneasler\'s virulent poison and daunting physical\nprowess, no other species could hope to best it on the frozen\nhighlands. Preferring solitude, this species does not form packs.','medium-slow',NULL,135,4),(905,904,'けんざんポケモン','Its lancelike spikes and savage temperament have earned it the\nnickname ”sea fiend.” It slurps up poison to nourish itself.','medium',NULL,135,4),(906,905,'あいぞうポケモン','When it flies to this land from across the sea, the bitter winter\ncomes to an end. According to legend, this Pokémon\'s love\ngives rise to the budding of fresh life across Hisui.','slow',NULL,3,8),(907,906,'くさねこポケモン','Its fluffy fur is similar in composition to plants. This Pokémon frequently washes its face to keep it from drying out.','medium-slow',50,45,1),(908,907,'くさねこポケモン','Floragato deftly wields the vine hidden beneath its long fur, slamming the hard flower bud against its opponents.','medium-slow',50,45,1),(909,908,'マジシャンポケモン','This Pokémon uses the reflective fur lining its cape to camouflage the stem of its flower, creating the illusion that the flower is floating.','medium-slow',50,45,1),(910,909,'ほのおワニポケモン','It lies on warm rocks and uses the heat absorbed by its square-shaped scales to create fire energy.','medium-slow',50,45,1),(911,910,'ほのおワニポケモン','The combination of Crocalor’s fire energy and overflowing vitality has caused an egg-shaped fireball to appear on the Pokémon’s head.','medium-slow',50,45,1),(912,911,'シンガーポケモン','The fiery bird changes shape when Skeledirge sings. Rumor has it that the bird was born when the fireball on Skeledirge’s head gained a soul.','medium-slow',50,45,1),(913,912,'こがもポケモン','This Pokémon migrated to Paldea from distant lands long ago. The gel secreted by its feathers repels water and grime.\"','medium-slow',50,45,1),(914,913,'レッスンポケモン','These Pokémon constantly run through shallow waters to train their legs, then compete with each other to see which of them kicks most gracefully.','medium-slow',50,45,1),(915,914,'ダンサーポケモン','A single kick from a Quaquaval can send a truck rolling. This Pokémon uses its powerful legs to perform striking dances from far-off lands.','medium-slow',50,45,1),(916,915,'ぶたポケモン','It searches for food all day. It possesses a keen sense of smell but doesn’t use it for anything other than foraging.','medium',50,255,4),(917,916,'ぶたポケモン','Oinkologne is proud of its fine, glossy skin. It emits a concentrated scent from the tip of its tail.','medium',50,100,0),(918,917,'Fadenkugel','The ball of threads wrapped around its body is elastic enough to deflect the scythes of Scyther, this Pokémon’s natural enemy.','slow-then-very-fast',50,255,4),(919,918,'トラップポケモン','It clings to branches and ceilings using its threads and moves without a sound. It takes out its prey before the prey even notices it.','slow-then-very-fast',50,120,4),(920,919,'バッタポケモン','It has its third set of legs folded up. When it’s in a tough spot, this Pokémon jumps over 30 feet using the strength of its legs.','medium',20,190,4),(921,920,'バッタポケモン','When it decides to fight all out, it stands on its previously folded legs to enter Showdown Mode. It neutralizes its enemies in short order.','medium',0,30,4),(922,921,'ねずみポケモン','It has underdeveloped electric sacs on its cheeks. These sacs can produce electricity only if Pawmi rubs them furiously with the pads on its forepaws.','medium',50,190,4),(923,922,'ねずみポケモン','When its group is attacked, Pawmo is the first to leap into battle, defeating enemies with a fighting technique that utilizes electric shocks.','medium',50,80,4),(924,923,'てあてポケモン','This Pokémon normally is slow to react, but once it enters battle, it will strike down its enemies with lightning-fast movements.','medium',50,45,4),(925,924,'カップルポケモン','Exhibiting great teamwork, they use their incisors to cut pieces out of any material that might be useful for a nest, then make off with them.','fast',50,150,-1),(926,925,'ファミリーポケモン','The two little ones just appeared one day. The group might be a family of related Pokémon, but nobody knows for sure.','fast',50,75,-1),(927,926,'こいぬポケモン','This Pokémon is smooth and moist to the touch. Yeast in Fidough’s breath induces fermentation in the Pokémon’s vicinity.','medium-slow',50,190,4),(928,927,'いぬポケモン','The pleasant aroma that emanates from this Pokémon’s body helps wheat grow, so Dachsbun has been treasured by farming villages.','medium-slow',50,90,4),(929,928,'オリーブポケモン','It protects itself from enemies by emitting oil from the fruit on its head. This oil is bitter and astringent enough to make someone flinch.','medium-slow',50,255,4),(930,929,'オリーブポケモン','Dolliv shares its tasty, fresh-scented oil with others. This species has coexisted with humans since times long gone.','medium-slow',50,120,4),(931,930,'オリーブポケモン','This calm Pokémon is very compassionate. It will share its delicious, nutrient-rich oil with weakened Pokémon.','medium-slow',50,45,4),(932,931,'インコポケモン','These Pokémon prefer to live in cities. They form flocks based on the color of their feathers, and they fight over territory.','slow-then-very-fast',50,190,4),(933,932,'がんえんポケモン','It was born in a layer of rock salt deep under the earth. This species was particularly treasured in the old days, as they would share precious salt.','medium-slow',50,255,4),(934,933,'がんえんポケモン','This Pokémon dry cures its prey by spraying salt over them. The curing process steals away the water in the prey’s body.','medium-slow',50,120,4),(935,934,'がんえんポケモン','Garganacl will rub its fingertips together and sprinkle injured Pokémon with salt. Even severe wounds will promptly heal afterward.','medium-slow',50,45,4),(936,935,'ひのこポケモン','Burnt charcoal came to life and became a Pokémon. Possessing a fiery fighting spirit, Charcadet will battle even tough opponents.','slow',50,90,4),(937,936,'ひのせんしポケモン','Armarouge evolved through the use of a set of armor that belonged to a distinguished warrior. This Pokémon is incredibly loyal.','slow',20,25,4),(938,937,'ひのけんしポケモン','The fiery blades on its arms burn fiercely with the lingering resentment of a sword wielder who fell before accomplishing their goal.','slow',20,25,4),(939,938,'でんきおたまポケモン','Tadbulb shakes its tail to generate electricity. If it senses danger, it will make its head blink on and off to alert its allies.','medium',50,190,4),(940,939,'でんきがえるポケモン','When this Pokémon expands and contracts its wobbly body, the belly-button dynamo in its stomach produces a huge amount of electricity.','medium',50,50,4),(941,940,'うみつばめポケモン','When its wings catch the wind, the bones within produce electricity. This Pokémon dives into the ocean, catching prey by electrocuting them.','medium-slow',50,180,4),(942,941,'ぐんかんどりポケモン','Kilowattrel inflates its throat sac to amplify its electricity. By riding the wind, this Pokémon can fly over 430 miles in a day.','medium-slow',50,90,4),(943,942,'わかぞうポケモン','It always scowls in an attempt to make opponents take it seriously, but even crying children will burst into laughter when they see Maschiff’s face.','medium-slow',50,150,4),(944,943,'おやぶんポケモン','This Pokémon can store energy in its large dewlap. Mabosstiff unleashes this energy all at once to blow away enemies.','medium-slow',50,75,4),(945,944,'どくねずみポケモン','Though usually a mellow Pokémon, it will sink its sharp, poison-soaked front teeth into any that anger it, causing paralysis in the object of its ire.','medium-slow',50,190,4),(946,945,'どくざるポケモン','The color of the poisonous saliva depends on what the Pokémon eats. Grafaiai covers its fingers in its saliva and draws patterns on trees in forests.','medium-slow',50,90,4),(947,946,'ころがりぐさポケモン','A soul unable to move on to the afterlife was blown around by the wind until it got tangled up with dried grass and became a Pokémon.','medium',50,190,4),(948,947,'ころがりぐさポケモン','It will open the branches of its head to envelop its prey. Once it absorbs all the life energy it needs, it expels the prey and discards it.','medium',50,45,4),(949,948,'きくらげポケモン','Toedscool lives in muggy forests. The flaps that fall from its body are chewy and very delicious.','medium-slow',50,190,4),(950,949,'きくらげポケモン','These Pokémon gather into groups and form colonies deep within forests. They absolutely hate it when strangers approach.','medium-slow',50,90,4),(951,950,'まちぶせポケモン','Klawf hangs upside-down from cliffs, waiting for prey. But Klawf can’t remain in this position for long because its blood rushes to its head.','medium',50,120,4),(952,951,'ハバネロポケモン','The more sunlight this Pokémon bathes in, the more spicy chemicals are produced by its body, and thus the spicier its moves become.','medium',50,190,4),(953,952,'ハバネロポケモン','The red head converts spicy chemicals into fire energy and blasts the surrounding area with a super spicy stream of flame.','medium',50,75,4),(954,953,'ころがしポケモン','This Pokémon creates a mud ball by mixing sand and dirt with psychic energy. It treasures its mud ball more than its own life.','fast',50,190,4),(955,954,'ころがしポケモン','The body that supports the ball barely moves. Therefore, it is thought that the true body of this Pokémon is actually inside the ball.','fast',50,45,4),(956,955,'フリルポケモン','Flittle’s toes levitate about half an inch above the ground because of the psychic power emitted from the frills on the Pokémon’s belly.','medium-slow',50,120,4),(957,956,'ダチョウポケモン','It immobilizes opponents by bathing them in psychic power from its large eyes. Despite its appearance, it has a vicious temperament.','medium-slow',50,60,4),(958,957,'かなうちポケモン','It swings its handmade hammer around to protect itself, but the hammer is often stolen by Pokémon that eat metal.','medium-slow',50,190,8),(959,958,'ハンマーポケモン','This Pokémon will attack groups of Pawniard and Bisharp, gathering metal from them in order to create a large and sturdy hammer.','medium-slow',50,90,8),(960,959,'ハンマーポケモン','This intelligent Pokémon has a very daring disposition. It knocks rocks into the sky with its hammer, aiming for flying Corviknight.','medium-slow',50,45,8),(961,960,'あなごポケモン','This Pokémon can pick up the scent of a Veluza just over 65 feet away and will hide itself in the sand.','medium',50,255,4),(962,961,'あなごポケモン','It has a vicious temperament, contrary to what its appearance may suggest. It wraps its long bodies around prey, then drags the prey into its den.','medium',50,50,4),(963,962,'おとしものポケモン','It gathers things up in an apron made from shed feathers added to the Pokémon’s chest feathers, then drops those things from high places for fun.','slow',50,25,4),(964,963,'イルカポケモン','It likes playing with others of its kind using the water ring on its tail. It uses ultrasonic waves to sense the emotions of other living creatures.','slow',50,200,4),(965,964,'イルカポケモン','This Pokémon changes its appearance if it hears its allies calling for help. Palafin will never show anybody its moment of transformation.','slow',50,45,4),(966,965,'たんきとうポケモン','It is said that this Pokémon was born when an unknown poison Pokémon entered and inspirited an engine left at a scrap-processing factory.','medium',50,190,4),(967,966,'たきとうポケモン','It creates a gas out of poison and minerals from rocks. It then detonates the gas in its cylinders—now numbering eight—to generate energy.','medium',50,75,4),(968,967,'ライドポケモン','Apparently Cyclizar has been allowing people to ride on its back since ancient times. Depictions of this have been found in 10,000-year-old murals.','medium-slow',50,190,4),(969,968,'ミミズポケモン','When attacked, this Pokémon will wield the tendrils on its body like fists and pelt the opponent with a storm of punches.','slow',50,25,4),(970,969,'こうせきポケモン','It absorbs nutrients from cave walls. The petals it wears are made of crystallized poison.','medium-slow',50,70,4),(971,970,'こうせきポケモン','When this Pokémon detects danger, it will open up its crystalline petals and fire beams from its conical body.','medium-slow',50,25,4),(972,971,'おばけいぬポケモン','It is said that a dog Pokémon that died in the wild without ever interacting with a human was reborn as this Pokémon.','medium-slow',50,120,4),(973,972,'おばけいぬポケモン','Houndstone spends most of its time sleeping in graveyards. Among all the dog Pokémon, this one is most loyal to its master.','medium-slow',50,60,4),(974,973,'シンクロポケモン','This Pokémon apparently ties the base of its neck into a knot so that energy stored in its belly does not escape from its beak.','medium-slow',50,100,4),(975,974,'りくくじらポケモン','This species left the ocean and began living on land a very long time ago. It seems to be closely related to Wailmer.','medium-slow',50,150,4),(976,975,'りくくじらポケモン','This Pokémon wanders around snowy, icy areas. It protects its body with powerful muscles and a thick layer of fat under its skin.','medium-slow',50,50,4),(977,976,'きりはなしポケモン','When Veluza discards unnecessary flesh, its mind becomes honed and its psychic power increases. The spare flesh has a mild but delicious flavor.','fast',50,100,4),(978,977,'おおなまずポケモン','This Pokémon is a glutton, but it’s bad at getting food. It teams up with a Tatsugiri to catch prey.','slow',50,25,4),(979,978,'ぎたいポケモン','This is a small dragon Pokémon. It lives inside the mouth of Dondozo to protect itself from enemies on the outside.','medium-slow',50,100,4),(980,979,'ふんどざるポケモン','When its anger rose beyond a critical point, this Pokémon gained power that is unfettered by the limits of its physical body.','medium',50,45,4),(981,980,'とげうおポケモン','When attacked, this Pokémon will retaliate by sticking thick spines out from its body. It’s a risky move that puts everything on the line.','medium',50,90,4),(982,981,'くびながポケモン','Now that the brain waves from the head and tail are synced up, the psychic power of this Pokémon is 10 times stronger than Girafarig’s.','medium',50,45,4),(983,982,'つちへびポケモン','This Pokémon uses its hard tail to make its nest by boring holes into bedrock deep underground. The nest can reach lengths of over six miles.','medium',50,45,4),(984,983,'だいとうポケモン','Only a Bisharp that stands above all others in its vast army can evolve into Kingambit.','medium',50,25,4),(985,984,'パラドックスポケモン','Sightings of this Pokémon have occurred in recent years. The name Great Tusk was taken from a creature listed in a certain book.','slow',0,30,-1),(986,985,'パラドックスポケモン','There has been only one reported sighting of this Pokémon. It resembles a mysterious creature depicted in an old expedition journal.','slow',0,50,-1),(987,986,'パラドックスポケモン','It is possible that the creature listed as Brute Bonnet in a certain book could actually be this Pokémon.','slow',0,50,-1),(988,987,'パラドックスポケモン','This Pokémon has characteristics similar to those of Flutter Mane, a creature mentioned in a certain book.','slow',0,30,-1),(989,988,'パラドックスポケモン','This mysterious Pokémon has some similarities to a creature that an old book introduced as Slither Wing.','slow',0,30,-1),(990,989,'パラドックスポケモン','No records exist of this Pokémon being caught. Data is lacking, but the Pokémon’s traits match up with a creature shown in an expedition journal.','slow',0,30,-1),(991,990,'パラドックスポケモン','This Pokémon closely resembles a scientific weapon that a paranormal magazine claimed was sent to this planet by aliens.','slow',0,30,-1),(992,991,'パラドックスポケモン','Its shape is similar to a robot featured in a paranormal magazine article. The robot was said to have been created by an ancient civilization.','slow',0,50,-1),(993,992,'パラドックスポケモン','It is very similar to a cyborg covered exclusively by a paranormal magazine. The cyborg was said to be the modified form of a certain athlete.','slow',0,50,-1),(994,993,'パラドックスポケモン','It resembles a certain Pokémon introduced in a paranormal magazine, described as the offspring of a Hydreigon that fell in love with a robot.','slow',0,30,-1),(995,994,'パラドックスポケモン','This Pokémon resembles an unknown object described in a paranormal magazine as a UFO sent to observe humanity.','slow',0,30,-1),(996,995,'パラドックスポケモン','It has some similarities to a Pokémon introduced in a dubious magazine as a Tyranitar from one billion years into the future.','slow',0,30,-1),(997,996,'こおりビレポケモン','Frigibax absorbs heat through its dorsal fin and converts the heat into ice energy. The higher the temperature, the more energy Frigibax stores.','slow',50,45,4),(998,997,'こおりビレポケモン','Arctibax freezes the air around it, protecting its face with an ice mask and turning its dorsal fin into a blade of ice.','slow',50,25,4),(999,998,'ひょうりゅうポケモン','This Pokémon blasts cryogenic air out from its mouth. This air can instantly freeze even liquid-hot lava.','slow',50,10,4),(1000,999,'たからばこポケモン','This Pokémon was born inside a treasure chest about 1,500 years ago. It sucks the life-force out of scoundrels who try to steal the treasure.','slow',50,45,-1),(1001,1000,'たからものポケモン','Its body seems to be made up of 1,000 coins. This Pokémon gets along well with others and is quick to make friends with anybody.','slow',50,45,-1),(1002,1001,'さいやくポケモン','The grudge of a person punished for writing the king’s evil deeds upon wooden tablets has clad itself in dead leaves to become a Pokémon.','slow',0,6,-1),(1003,1002,'さいやくポケモン','This Pokémon can control 100 tons of fallen snow. It plays around innocently by leaping in and out of avalanches it has caused.','slow',0,6,-1),(1004,1003,'さいやくポケモン','The fear poured into an ancient ritual vessel has clad itself in rocks and dirt to become a Pokémon.','slow',0,6,-1),(1005,1004,'さいやくポケモン','It controls flames burning at over 5,400 degrees Fahrenheit. It casually swims through the sea of lava it creates by melting rock and sand.','slow',0,6,-1),(1006,1005,'パラドックスポケモン','It is possible that this is the creature listed as Roaring Moon in an expedition journal that still holds many mysteries.','slow',0,10,-1),(1007,1006,'パラドックスポケモン','It has some similarities to a mad scientist’s invention covered in a paranormal magazine.','slow',0,10,-1),(1008,1007,'パラドックスポケモン','This seems to be the Winged King mentioned in an old expedition journal. It was said to have split the land with its bare fists.','slow',0,3,-1),(1009,1008,'パラドックスポケモン','Much remains unknown about this creature. It resembles Cyclizar, but it is far more ruthless and powerful.','slow',0,3,-1),(1010,1009,'パラドックスポケモン','This ferocious creature is shrouded in mystery. It\'s named after an aquatic monster mentioned in an old expedition journal.','slow',0,5,-1),(1011,1010,'パラドックスポケモン','Many of its physical characteristics match those of a Virizion from the future that was covered in a paranormal magazine.','slow',0,5,-1);
